(1, '-02', '/public/images/pals/T_BossDemo_Image_Snow.png', 'Victor & Shadowbeak', 'https://palworld.fandom.com/wiki/Victor_Ashford', 'https://static.wikia.nocookie.net/palworld/images/5/5b/Victor_and_Shadowbeak.png', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 1}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Modified DNA\", \"Tech\": \"Shadowbeak Saddle\", \"Description\": \"Can be ridden as a flying mount. Enhances Dark attacks while mounted.\"}', 'Born from the depths of insanity, its very existence defies reason. Having lost all genetic ties to other Pals, one wonders if it could still even be considered a Pal.', '[{\"Name\": \"Divine Disaster\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 160, \"Cooldown\": 45, \"Description\": \"Charges forward, generating orbs of light that automatically target enemies  and unleash a barrage of lasers.\"}, {\"Name\": \"Dark Whisp\", \"Type\": \"Dark\", \"Level\": 2, \"Power\": 160, \"Cooldown\": 45, \"Description\": \"Fires a menacing ball of dark energy that pursues enemies.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 3, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 4, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Blizzard Spike\", \"Type\": \"Ice\", \"Level\": 5, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Creates a giant lump of ice and hurls it at an enemy. It deals damage to those in the surrounding area upon impact.\"}, {\"Name\": \"Iceberg\", \"Type\": \"Ice\", \"Level\": 6, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Summons a sharp ice lance under an enemy.\"}, {\"Name\": \"Dark Laser\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges dark energy before blasting enemies with a powerful beam.\"}, {\"Name\": \"Crystal Breath\", \"Type\": \"Ice\", \"Level\": 8, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Enshrouds an enemy in a frigid blast of air, dealing continuous damage.\"}, {\"Name\": \"Pal Blast\", \"Type\": \"Neutral\", \"Level\": 9, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges destructive energy before firing a high-powered beam forward across a wide area.\"}, {\"Name\": \"Ice Missile\", \"Type\": \"Ice\", \"Level\": 10, \"Power\": 30, \"Cooldown\": 3, \"Description\": \"Creates ice lances in the air that fly towards enemies.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 11, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}]', '{\"HP\": 120, \"Food\": 8, \"Speed\": {\"Run\": 850, \"Ride\": 1300, \"Walk\": 80}, \"Attack\": {\"Melee\": 130, \"Ranged\": 120}, \"Defense\": 140, \"Stamina\": 100, \"Support\": 90, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 53.533333, \"Transportspeed\": 465, \"EnemyInflictDamageRate\": 1.5454545, \"EnemyReceiveDamageRate\": 0.6571429}', 'GYM BlackGriffon', 'FourLegged', 10, 9060, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 1, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(2, '-02', '/public/images/pals/T_BossDemo_Image_Grass.png', 'Zoe & Grizzbolt', 'https://palworld.fandom.com/wiki/Zoe_Rayne', 'https://static.wikia.nocookie.net/palworld/images/f/f9/Zoe_and_Grizzbolt.png', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Yellow Tank\", \"Tech\": \"Grizzbolt\'s Minigun\", \"Description\": \"Can be ridden. Can rapidly fire a minigun while mounted.\"}', 'With a friendly smile and a hardy physique, it is docile towards one it recognizes as a partner. For reasons unexplained, its personality undergoes a drastic change when wielding a minigun.', '[{\"Name\": \"Lightning Claw\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Grizzbolt\'s exclusive skill. After leaping at an enemy and tearing at it twice with its electrically charged claws, it attacks the ground, sending an electric shock throughout the area.\"}, {\"Name\": \"Spark Blast\", \"Type\": \"Electricity\", \"Level\": 2, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Releases lightning orbs in a fan shape,  spreading as they travel.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 3, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Electric Ball\", \"Type\": \"Electricity\", \"Level\": 4, \"Power\": 50, \"Cooldown\": 9, \"Description\": \"Fires an electric ball that slowly pursues an enemy.\"}, {\"Name\": \"Plasma Funnel\", \"Type\": \"Electricity\", \"Level\": 5, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Creates two balls of electric energy that fire numerous lightning orbs at enemies.\"}, {\"Name\": \"Lock-on Laser\", \"Type\": \"Electricity\", \"Level\": 6, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Takes aim at an enemy before firing a super high speed laser.\"}]', '{\"HP\": 105, \"Food\": 6, \"Speed\": {\"Run\": 470, \"Ride\": 650, \"Walk\": 140}, \"Attack\": {\"Melee\": 100, \"Ranged\": 100}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 28.418604, \"Transportspeed\": 287, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'GYM ElecPanda', 'Humanoid', 8, 6610, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 0, 1, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(3, '-02', '/public/images/pals/T_BossDemo_Image_Desert.png', 'Marcus & Faleris', 'https://palworld.fandom.com/wiki/Marcus_Dryden', 'https://static.wikia.nocookie.net/palworld/images/9/9c/Marcus_and_Faleris.png', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Scorching Predator\", \"Tech\": \"Faleris Saddle\", \"Description\": \"Can be ridden as a flying mount. While fighting together, Ice Pals drop more items when defeated.\"}', 'When it finds its prey it unleashes a whirlwind of flames, burning the entire area to ash. Faleris breath is known for its pleasing scent.', '[{\"Name\": \"Phoenix Flare\", \"Type\": \"Fire\", \"Level\": 1, \"Power\": 135, \"Cooldown\": 28, \"Description\": \"Faleris\' exclusive skill. After creating scorching tornadoes, it cloaks itself in hellfire and charges forward.\"}, {\"Name\": \"Flare Arrow\", \"Type\": \"Fire\", \"Level\": 2, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires three flaming arrows in succession that home in on an enemy.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 3, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}, {\"Name\": \"Ignis Breath\", \"Type\": \"Fire\", \"Level\": 4, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Shoots flames at an enemy, dealing continuous damage.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 5, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Ignis Rage\", \"Type\": \"Fire\", \"Level\": 6, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Infuses the surrounding ground with energy,  causing it to explode after a set amount of time.\"}, {\"Name\": \"Fire Ball\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Creates a giant ball of flame and hurls it at an enemy. The ball explodes over a wide area upon impact.\"}, {\"Name\": \"Lightning Strike\", \"Type\": \"Electricity\", \"Level\": 8, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Acts as a lightning rod, calling down thunderbolts that electrocute the surrounding area.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 9, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 10, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 11, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}]', '{\"HP\": 100, \"Food\": 8, \"Speed\": {\"Run\": 1000, \"Ride\": 1500, \"Walk\": 200}, \"Attack\": {\"Melee\": 100, \"Ranged\": 105}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 90, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 49.403362, \"Transportspeed\": 500, \"EnemyInflictDamageRate\": 1.1114168, \"EnemyReceiveDamageRate\": 0.8927152}', 'GYM Horus', 'Bird', 9, 6720, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 0, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(4, '-02', '/public/images/pals/T_BossDemo_Image_Forest.png', 'Lily & Lyleen', 'https://palworld.fandom.com/wiki/Lily_Everhart', 'https://static.wikia.nocookie.net/palworld/images/1/18/Lily_and_Lyleen.png', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 3}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Harvest Goddess\", \"Tech\": \"Lyleen\'s Floral Ornament\", \"Description\": \"When activated,  the queen\'s soothing graces greatly restore the player\'s Health.\"}', 'A docile Pal full of love. It watches over small Pals who have lost their parents. It uses a full-power Solar Blast to discipline naughty Pals.', '[{\"Name\": \"Poison Fog\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 0, \"Cooldown\": 30, \"Description\": \"Generates a fog of poison in front,  causing the opponent to become poisoned.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 2, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Seed Mine\", \"Type\": \"Leaf\", \"Level\": 3, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Launches a deadly seed. If it hits an enemy, the seed explodes.\"}, {\"Name\": \"Aqua Burst\", \"Type\": \"Water\", \"Level\": 4, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of water and hurls it at an enemy.\"}, {\"Name\": \"Multicutter\", \"Type\": \"Leaf\", \"Level\": 5, \"Power\": 60, \"Cooldown\": 12, \"Description\": \"The user fires three high-speed blades of wind in quick succession that fly straight at enemies.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 6, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Spine Vine\", \"Type\": \"Leaf\", \"Level\": 7, \"Power\": 95, \"Cooldown\": 25, \"Description\": \"Generates spiny thorns that chase an enemy along the ground, piercing them from below.\"}]', '{\"HP\": 110, \"Food\": 6, \"Speed\": {\"Run\": 450, \"Ride\": 650, \"Walk\": 100}, \"Attack\": {\"Melee\": 100, \"Ranged\": 110}, \"Defense\": 105, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 34.6875, \"Transportspeed\": 275, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'GYM LilyQueen', 'Humanoid', 9, 6510, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 0, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(5, '-02', '/public/images/pals/T_BossDemo_Image_Volcano.png', 'Axel & Orserk', 'https://palworld.fandom.com/wiki/Axel_Travers', 'https://static.wikia.nocookie.net/palworld/images/b/b0/Axel_and_Orserk.png', '[{\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}, {\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Ferocious Thunder Dragon\", \"Tech\": null, \"Description\": \"While fighting together, Water Pals drop more items when defeated.\"}', 'It sends electricity into its foes\' wounds, roasting them from the inside out. Fights between Orserk end in the blink of an eye.', '[{\"Name\": \"Kerauno\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Orserk\'s exclusive skill. Summons a spear of lightning while leaping into the air before throwing it at an enemy.\"}, {\"Name\": \"Lightning Strike\", \"Type\": \"Electricity\", \"Level\": 2, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Acts as a lightning rod, calling down thunderbolts that electrocute the surrounding area.\"}, {\"Name\": \"Dragon Burst\", \"Type\": \"Dragon\", \"Level\": 3, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges draconic energy, damaging those around it.\"}, {\"Name\": \"Draconic Breath\", \"Type\": \"Dragon\", \"Level\": 4, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Exhales breath imbued with draconic energy, dealing continuous damage to those in front of it.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 5, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Dragon Cannon\", \"Type\": \"Dragon\", \"Level\": 6, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls an energy ball imbued with draconic energy at an enemy.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 8, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Dragon Meteor\", \"Type\": \"Dragon\", \"Level\": 9, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Summons numerous small meteorites and launches them at an enemy.\"}]', '{\"HP\": 100, \"Food\": 7, \"Speed\": {\"Run\": 900, \"Ride\": 1300, \"Walk\": 185}, \"Attack\": {\"Melee\": 100, \"Ranged\": 130}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 48.4075, \"Transportspeed\": 542, \"EnemyInflictDamageRate\": 1.0612245, \"EnemyReceiveDamageRate\": 0.92105263}', 'GYM ThunderDragonMan', 'Humanoid', 9, 8320, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 0, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(6, '-02', '/public/images/pals/T_MoonQueen_icon_normal.png', 'Saya & Selyne', 'https://palworld.fandom.com/wiki/Saya_Kurosaki', 'https://static.wikia.nocookie.net/palworld/images/2/2f/Saya_and_Selyne.png', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}, {\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Celestial Darkness\", \"Tech\": \"Selyne Saddle\", \"Description\": \"Can be ridden as a flying mount. Enhances Neutral and Dark attacks while mounted.\"}', 'The object floating behind, resembling the moon, is said to gradually become more circular with each passing generation. No one knows what will happen when the moon is full. ', '[{\"Name\": \"Star Mine\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 110, \"Cooldown\": 55, \"Description\": \"Generates stars around the enemy that explode on contact. Stars also explode after some time.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 2, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Comet Strike\", \"Type\": \"Dragon\", \"Level\": 3, \"Power\": 110, \"Cooldown\": 35, \"Description\": \"Drops a meteorite straight down, generating a shock wave around the impact area.\"}, {\"Name\": \"Blizzard Spike\", \"Type\": \"Ice\", \"Level\": 4, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Creates a giant lump of ice and hurls it at an enemy. It deals damage to those in the surrounding area upon impact.\"}, {\"Name\": \"Moonlight Beam\", \"Type\": \"Neutral\", \"Level\": 5, \"Power\": 170, \"Cooldown\": 40, \"Description\": \"Selyne\'s exclusive skill. Stores energy in the moon on its back, then fires a crescent-shaped beam forward.\"}, {\"Name\": \"Seigetsu Blade\", \"Type\": \"Neutral\", \"Level\": 6, \"Power\": 110, \"Cooldown\": 24, \"Description\": \"Selyne\'s exclusive skill. Fires two consecutive high-speed blades imbued with the power of moonlight.\"}, {\"Name\": \"Holy Burst\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 120, \"Cooldown\": 30, \"Description\": \"Creates a wide explosion of light at the enemy\'s location and around it.\"}, {\"Name\": \"Air Blade\", \"Type\": \"Neutral\", \"Level\": 8, \"Power\": 85, \"Cooldown\": 20, \"Description\": \"Sends out sharp blades of air in a fan shape.\"}, {\"Name\": \"Dark Arrow\", \"Type\": \"Dark\", \"Level\": 9, \"Power\": 65, \"Cooldown\": 10, \"Description\": \"Fires off dark energy that homes in on an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 10, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Diamond Rain\", \"Type\": \"Ice\", \"Level\": 11, \"Power\": 160, \"Cooldown\": 60, \"Description\": \"Creates numerous lumps of ice that are consecutively dropped on a foe\'s head.\"}]', '{\"HP\": 130, \"Food\": 2, \"Speed\": {\"Run\": 450, \"Ride\": 550, \"Walk\": 150}, \"Attack\": {\"Melee\": 100, \"Ranged\": 115}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 60.0, \"Transportspeed\": 275, \"EnemyInflictDamageRate\": 3.5, \"EnemyReceiveDamageRate\": 1.0}', 'GYM MoonQueen', 'Humanoid', 9, 7400, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 1, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(7, '-01', '/public/images/pals/T_Alpaca_icon_normal.png', 'Melpaca', 'https://palworld.fandom.com/wiki/Melpaca', 'https://static.wikia.nocookie.net/palworld/images/7/7f/Melpaca_menu.png/', '[{\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Farming\", \"Image\": \"/public/images/suitability/T_icon_palwork_12.png\", \"Level\": 1}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 5, \"Min\": 2, \"Name\": \"Wool\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Neutral Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Pacapaca Wool\", \"Tech\": \"Melpaca Saddle\", \"Description\": \"Can be ridden. Sometimes drops Wool when assigned to Ranch.\"}', 'Don\'t be fooled by this Pal\'s fluffy appearance. A hypersonic kick from one of its long legs may send you flying to the other side of the world.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Fluffy Tackle\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Melpaca\'s exclusive skill. Charges forward while surrounded by an adorable aura.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 40, \"Power\": 70,