(8, '-01', '/public/images/pals/T_AmaterasuWolf_icon_normal.png', 'Kitsun', 'https://palworld.fandom.com/wiki/Kitsun', 'https://static.wikia.nocookie.net/palworld/images/6/6b/Kitsun_menu.png/', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 2}]', '[{\"Max\": 8, \"Min\": 6, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Flame Organ\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 8, \"Min\": 6, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Fire Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Clear Mind\", \"Tech\": \"Kitsun Saddle\", \"Description\": \"Can be ridden. Unaffected by the cold or heat while riding this Pal.\"}', 'Despite its appearance, Kitsun is extremely sensitive and will flee into a cave when spooked. Long ago, it was considered an ill omen if one ran away from you.', '[{\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Daring Flames\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 10, \"Description\": \"Kitsun\'s exclusive skill. Charges forward with great speed while enveloped in intense blue flames.\"}, {\"Name\": \"Flare Storm\", \"Type\": \"Fire\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"De