: \"Flare Arrow\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires three flaming arrows in succession that home in on an enemy.\"}, {\"Name\": \"Flare Storm\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two flaming tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Flame Wall\", \"Type\": \"Fire\", \"Level\": 30, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a wall of flames at the enemy\'s location. The wall of flames will remain for a while, and deal damage to the enemies it touches.\"}, {\"Name\": \"Flame Funnel\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Creates multiple spheres of fiery energy, from which countless fireballs shoot towards the enemy.\"}, {\"Name\": \"Fire Ball\", \"Type\": \"Fire\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Creates a giant ball of flame and hurls it at an enemy. The ball explodes over a wide area upon impact.\"}]', '{\"HP\": 114, \"Food\": 5, \"Speed\": {\"Run\": 440, \"Ride\": 620, \"Walk\": 145}, \"Attack\": {\"Melee\": 100, \"Ranged\": 105}, \"Defense\": 90, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 292, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS CatMage Fire', 'Humanoid', 8, 8240, 'XL', 'FieldBoss', '{\"day\": null, \"night\": null}', 'Boss', 1, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}');
