(31, '-01', '/public/images/pals/T_CatVampire_icon_normal.png', 'Felbat', 'https://palworld.fandom.com/wiki/Felbat', 'https://static.wikia.nocookie.net/palworld/images/7/7d/Felbat_menu.png/', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 3}]', '[{\"Max\": 3, \"Min\": 1, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Cloth\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Small Pal Soul\", \"Rate\": 3.0}, {\"Max\": 3, \"Min\": 1, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Dark Resistance\", \"Rate\": 5.0}]', '{\"Name\": \"Life Steal\", \"Tech\": null, \"Description\": \"While fighting together, grants the player and Felbat the life steal effect which absorbs some of the received damage and restores Health.\"}', 'Attacking from the shadows, this Pal traps its prey within its cloak-like wings. It\'s probably best not to know what happens within them, or why the inside of its wings are stained red.', '[{\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Dark Ball\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Unleashes a sphere of darkness  that slowly tracks down an enemy.\"}, {\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a g