(90, '-01', '/public/images/pals/T_KingBahamut_Dragon_icon_normal.png', 'Blazamut Ryu', 'https://palworld.fandom.com/wiki/Blazamut_Ryu', 'https://static.wikia.nocookie.net/palworld/images/d/d9/Blazamut_Ryu.png', '[{\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}, {\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 4}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 4}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 10, \"Min\": 10, \"Name\": \"Coal\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Medium Pal Soul\", \"Rate\": 5.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Precious Claw\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Dark Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Dragon Kaiser\", \"Tech\": \"Blazamut Ryu Saddle\", \"Description\": \"Can be ridden. Enhances Dragon attacks while mounted.\"}', 'Long ago, it emerged from the depths of the earth. With relentless, raging flames showing no mercy, it burned the entire island until nothing remained. It was known as the Eternal Flame.', '[{\"Name\": \"Dragon Burst\", \"Type\": \"Dragon\", \"Level\": 1, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges draconic energy, damaging those around it.\"}, {\"Name\": \"Ignis Breath\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Shoots flames at an enemy, dealing continuous damage.\"}, {\"Name\": \"Flame Wall\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a wall of flames at the enemy\'s location. The wall of flames will remain for a while, and deal damage to the enemies it touches.\"}, {\"Name\": \"Comet Strike\", \"Type\": \"Dragon\", \"Level\": 22, \"Power\": 110, \"Cooldown\": 35, \"Description\": \"Drops a meteorite straight down, generating a shock wave around the impact area.\"}, {\"Name\": \"Beam Slicer\", \"Type\": \"Dragon\", \"Level\": 30, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Mows down the frontal area with a beam imbued with dragon power. The area touched by the beam will also explode after a few moments.\"}, {\"Name\": \"Brawn Impact\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 38, \"Description\": \"Blazamut\'s exclusive skill. Raises and inflates its arms, then slams them together,  causing a massive explosion in the surrounding area.\"}, {\"Name\": \"Magna Crush\", \"Type\": \"Dragon\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 42, \"Description\": \"Blazamut Ryu\'s exclusive skill. After a big jump, moves at high speed in the air, gathering strength to unleash a powerful punch.\"}]', '{\"HP\": 126, \"Food\": 9, \"Speed\": {\"Run\": 700, \"Ride\": 1000, \"Walk\": 400}, \"Attack\": {\"Melee\": 150, \"Ranged\": 130}, \"Defense\": 125, \"Stamina\": 100, \"Support\": 50, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 500, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS KingBahamut Dragon', 'FourLegged', 8, 21040, 'XL', 'FieldBoss', '{\"day\": null, \"night\": null}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(91, '-01', '/public/images/pals/T_Kirin_icon_normal.png', 'Univolt', 'https://palworld.fandom.com/wiki/Univolt', 'https://static.wikia.nocookie.net/palworld/images/0/0e/Univolt_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 1}]', '[{\"Max\": 4, \"Min\": 2, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 4, \"Min\": 2, \"Name\": \"Precious Claw\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Lightning Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Swift Deity\", \"Tech\": \"Univolt Saddle\", \"Description\": \"Can be ridden. Applies Electric damage to the player\'s attacks while mounted.\"}', 'It used to be considered an emissary of the Thunder God, and thus was not hunted by people. However, after witnesses observed one die from a lightning strike, its reverence faded, and it quite literally fell into the role of a workhorse.', '[{\"Name\": \"Spark Blast\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Releases lightning orbs in a fan shape,  spreading as they travel.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Lock-on Laser\", \"Type\": \"Electricity\", \"Level\": 15, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Takes aim at an enemy before firing a super high speed laser.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Lightning Strike\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Acts as a lightning rod, calling down thunderbolts that electrocute the surrounding area.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}]', '{\"HP\": 96, \"Food\": 5, \"Speed\": {\"Run\": 720, \"Ride\": 1200, \"Walk\": 130}, \"Attack\": {\"Melee\": 110, \"Ranged\": 105}, \"Defense\": 105, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 425, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS Kirin', 'FourLegged', 8, 8560, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_Kirin_day.png\", \"night\": \"/public/images/maps/BOSS_Kirin_night.png\"}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Univolt Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_Kirin.png\", \"Description\": \"Proof of defeating [Univolt, Swift Deity]. Simply possessing it permanently increases the stats of the Pals in your team.\"}');
