(117, '-01', '/public/images/pals/T_QueenBee_icon_normal.png', 'Elizabee', 'https://palworld.fandom.com/wiki/Elizabee', 'https://static.wikia.nocookie.net/palworld/images/a/a0/Elizabee_menu.png/', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 2}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 1}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 2}]', '[{\"Max\": 4, \"Min\": 2, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 5, \"Min\": 5, \"Name\": \"Honey\", \"Rate\": 100.0}, {\"Max\": 4, \"Min\": 2, \"Name\": \"Precious Plume\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Metal Armor Schematic 4\", \"Rate\": 3.0}]', '{\"Name\": \"Queen Bee Command\", \"Tech\": null, \"Description\": \"While fighting together, stats will increase the more Beegarde are in your team.\"}', 'A chosen queen to rule over Beegardes. There is a never ending stream of servants willing to work themselves to death for the pleasure of serving their queen.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Spinning Staff\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 9, \"Description\": \"Elizabee\'s exclusive skill. Channels power into its staff, and unleashes it in a whirl.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Spine Vine\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 95, \"Cooldown\": 25, \"Description\": \"Generates spiny thorns that chase an enemy along the ground, piercing them from below.\"}, {\"Name\": \"Solar Blast\", \"Type\": \"Leaf\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges solar energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 108, \"Food\": 7, \"Speed\": {\"Run\": 450, \"Ride\": 550, \"Walk\": 250}, \"Attack\": {\"Melee\": 100, \"Ranged\": 105}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 350, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS QueenBee', 'Humanoid', 8, 13660, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_QueenBee_day.png\", \"night\": \"/public/images/maps/BOSS_QueenBee_night.png\"}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Elizabee Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_QueenBee.png\", \"Description\": \"Proof of defeating [Elizabee, Empress of the Hive]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(118, '-01', '/public/images/pals/T_RaijinDaughter_icon_normal.png', 'Dazzi', 'https://palworld.fandom.com/wiki/Dazzi', 'https://static.wikia.nocookie.net/palworld/images/b/b0/Dazzi_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Dazzi Cloud\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Lightning Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Lady of Lightning\", \"Tech\": \"Dazzi\'s Necklace\", \"Description\": \"While in team, appears near the player. Follows up player attacks with lightning bolts.\"}', 'Often kind to lonely Pals. However, the moment a Pal mistakes this for actual friendship, it seizes the opportunity to blast them with a thunderbolt.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\