(157, '-01', '/public/images/pals/T_NightLady_icon_normal.png', 'Bellanoir', 'https://palworld.fandom.com/wiki/Bellanoir', 'https://static.wikia.nocookie.net/palworld/images/8/8a/Bellanoir.png', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 4}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 2}]', '[\"None\"]', '{\"Name\": \"Nightmare Iris\", \"Tech\": null, \"Description\": \"When activated, attacks targeted enemy with a powerful Nightmare Ray.\"}', 'Without existing, she quietly gazed upon the world. One day, she was seized with a longing to be seen. With unbridled lust for vengeance against reality, thus was born the Eclipsed Siren.', '[{\"Name\": \"Dark Cannon\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 50, \"Cooldown\": 2, \"Description\": \"Hurls an energy ball imbued with dark energy at an enemy.\"}, {\"Name\": \"Umbral Surge\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 2, \"Description\": \"Fires high-speed dark orbs in a fan shape,  spreading as they travel.\"}, {\"Name\": \"Dark Arrow\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 65, \"Cooldown\": 10, \"Description\": \"Fires off dark energy that homes in on an enemy.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Apocalypse\", \"Type\": \"Dark\", \"Level\": 40, \"Power\": 110, \"Cooldown\": 55, \"Description\": \"Generates several dar