round to shake before hurling a massive stone mass at its surroundings.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}, {\"Name\": \"Ground Cutter\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 145, \"Cooldown\": 35, \"Description\": \"Knocklem\'s exclusive skill. Takes a big swing and throws the ring from its back. The ring flies in a circular trajectory.\"}, {\"Name\": \"Sand Twister\", \"Type\": \"Earth\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 60, \"Description\": \"Creates multiple sand tornadoes. The tornadoes continuously spin in circles.\"}]', '{\"HP\": 126, \"Food\": 9, \"Speed\": {\"Run\": 550, \"Ride\": 700, \"Walk\": 190}, \"Attack\": {\"Melee\": 100, \"Ranged\": 110}, \"Defense\": 135, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 400, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.48}', 'BOSS WingGolem', 'Humanoid', 8, 20760, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_WingGolem_day.png\", \"night\": \"/public/images/maps/BOSS_WingGolem_night.png\"}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Kncklem Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_WingGolem.png\", \"Description\": \"Proof of defeating [Knocklem, Suit of Armor]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
