(176, '-01', '/public/images/pals/T_NightBlueHorse_icon_normal.png', 'Starryon', 'https://palworld.fandom.com/wiki/Starryon', 'https://static.wikia.nocookie.net/palworld/images/6/6b/Starryon.png', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Dark Fragment\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Dark Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Night Dancer\", \"Tech\": \"Starryon Saddle\", \"Description\": \"Can be ridden. Increases movement speed while mounted at night.\"}', 'It takes great pride in its flowing, gorgeous mane. If it finds a split end, it becomes so mortified it can\'t focus on running properly.  Because static electricity makes its hair frizzy, it avoids Azurmane at all costs.', '[{\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Dark Ball\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Unleashes a sphere of darkness  that slowly tracks down an enemy.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Ignis Rage\", \"Type\": \"Fire\", \"Level\": 30, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Infuses the surrounding ground with energy,  causing it to explode after a set amount of time.\"}, {\"Name\": \"Apocalypse\", \"Type\": \"Dark\", \"Level\": 40, \"Power\": 110, \"Cooldown\": 55, \"Description\": \"Generates several dark vortexes around the enemy.\"}, {\"Name\": \"Lethal Step\", \"Type\": \"Dark\", \"Level\": 50, \"Power\": 140, \"Cooldown\": 35, \"Description\": \"Starryon\'s exclusive skill. Confuses enemies with flickering steps and launches slashing attack with its sharp horns.\"}]', '{\"HP\": 132, \"Food\": 6, \"Speed\": {\"Run\": 900, \"Ride\": 1200, \"Walk\": 150}, \"Attack\": {\"Melee\": 100, \"Ranged\": 100}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": -1, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS NightBlueHorse', 'FourLegged', 8, 12440, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_NightBlueHorse_day.png\", \"night\": \"/public/images/maps/BOSS_NightBlueHorse_night.png\"}', 'Boss', 1, 0, 0, 0, 0, 0, '{\"Name\": \"Starryon Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_NightBlueHorse.png\", \"Description\": \"Proof of defeating [Starryon, Midnight Blue Mane]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(177, '-02', '/public/images/pals/T_SnowTigerBeastman_icon_normal.png', 'Bjorn & Bastigor', 'None', 'None', '[{\"Name\": \"Ice\", \"Image\": \"/public/images/elements/T_Icon_element_s_08.png\"}]', '[{\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 2}, {\"Type\": \"Cooling\", \"Image\": \"/public/images/suitability/T_icon_palwork_10.png\", \"Level\": 3}]', '\"Tower Boss Drops Missing.\"', '{\"Name\": \"Blizzard Crash\", \"Tech\": \"Bastigor\'s Hammer\", \"Description\": \"Can be ridden. While mounted, delivers crushing blows with a Ice-forged hammer.\"}', 'The sight of anything round gives it an uncontrollable urge to punch it. For <characterName id=|SnowTigerBeastMan|/> the toughest challenge, after simply living, is making a snowman.', '[{\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 1, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Icicle Bullet\", \"Type\": \"Ice\", \"Level\": 2, \"Power\": 110, \"Cooldown\": 35, \"Description\": \"Generates multiple sharp ice blocks in the sky and fires them at the enemy.\"}, {\"Name\": \"Frost Talon\", \"Type\": \"Ice\", \"Level\": 4, \"Power\": 95, \"Cooldown\": 17, \"Description\": \"Bastigor\'s exclusive skill. Stomps the ground, creating a fissure of ice ahead.  Then, rapidly closes the distance and slashes with the right hand.\"}, {\"Name\": \"Rockburst\", \"Type\": \"Earth\", \"Level\": 5, \"Power\": 130, \"Cooldown\": 35, \"Description\": \"Causes the ground to shake before hurling a massive stone mass at its surroundings.\"}, {\"Name\": \"Stone Beat\", \"Type\": \"Earth\", \"Level\": 6, \"Power\": 170, \"Cooldown\": 60, \"Description\": \"Shakes the ground and lifts a massive boulder into the air.\"}, {\"Name\": \"Diamond Rain\", \"Type\": \"Ice\", \"Level\": 7, \"Power\": 160, \"Cooldown\": 60, \"Description\": \"Creates numerous lumps of ice that are consecutively dropped on a foe\'s head.\"}, {\"Name\": \"Absolute Frost\", \"Type\": \"Ice\", \"Level\": 8, \"Power\": 140, \"Cooldown\": 50, \"Description\": \"Throws icicles in a wide area from under the enemy\'s feet.\"}, {\"Name\": \"Glacial Impact\", \"Type\": \"Ice\", \"Level\": 9, \"Power\": 190, \"Cooldown\": 52, \"Description\": \"Bastigor\'s exclusive skill. Let out a mighty roar and leap into the air. Then, embed both arms into the ground to create a massive ice crack.  Continue to channel power into the ground, ultimately causing a large explosion of ice energy\"}, {\"Name\": \"Curtain Splash\", \"Type\": \"Water\", \"Level\": 10, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Continously creates walls made from water columns at the enemy\'s location.\"}, {\"Name\": \"Splash\", \"Type\": \"Water\", \"Level\": 11, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates a column of water that travels in a straight line.\"}]', '{\"HP\": 140, \"Food\": 6, \"Speed\": {\"Run\": 700, \"Ride\": 900, \"Walk\": 225}, \"Attack\": {\"Melee\": 100, \"Ranged\": 130}, \"Defense\": 120, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 105.0, \"Transportspeed\": -1, \"EnemyInflictDamageRate\": 4.0, \"EnemyReceiveDamageRate\": 0.5}', 'GYM SnowTigerBeastman', 'Humanoid', 10, 4300, 'XL', 'TowerBoss', '{\"day\": null, \"night\": null}', 'Warlike', 0, 0, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(178, '-01', '/public/images/pals/T_BerryGoat_Dark_icon_normal.png', 'Caprity Noct', 'None', 'None', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 2}, {\"Type\": \"Farming\", \"Image\": \"/public/images/suitability/T_icon_palwork_12.png\", \"Level\": 1}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Caprity Meat\", \"Rate\": 100.0}, {\"Max\": 4, \"Min\": 2, \"Name\": \"Red Berries\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Horn\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Dark Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Venom Picker\", \"Tech\": null, \"Description\": \"Sometimes drops Venom Gland from its back when assigned to Ranch.\"}', 'The berries that grow on its back change flavor according to its emotions. The harsher the environment it grows in, the sweeter the berries become. This is why most Caprity Noct raised in captivity have never known love.', '[{\"Name\": \"Poison Fog\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 0, \"Cooldown\": 30, \"Description\": \"Generates a fog of poison in front,  causing the opponent to become poisoned.\"}, {\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Multicutter\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 60, \"Cooldown\": 12, \"Description\": \"The user fires three high-speed blades of wind in quick succession that fly straight at enemies.\"}, {\"Name\": \"Poison Shower\", \"Type\": \