(179, '-01', '/public/images/pals/T_Kitsunebi_Ice_icon_normal.png', 'Foxparks Cryst', 'https://palworld.fandom.com/wiki/Foxparks_Cryst', 'https://static.wikia.nocookie.net/palworld/images/1/14/Foxparks_Cryst.png', '[{\"Name\": \"Ice\", \"Image\": \"/public/images/elements/T_Icon_element_s_08.png\"}]', '[{\"Type\": \"Cooling\", \"Image\": \"/public/images/suitability/T_icon_palwork_10.png\", \"Level\": 1}]', '[{\"Max\": 5, \"Min\": 3, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 1, \"Name\": \"Ice Organ\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Ice Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Huggy Frost\", \"Tech\": \"Foxparks Cryst\'s Harness\", \"Description\": \"When activated, equips to the player and attacks using frigid air.\"}', 'It is unskilled at controlling cold air from the moment it is born and tends to choke on the frost it breathes unintentionally.  When Foxparks Cryst catches a cold, its nasal discharge freezes,  making it difficult to breathe and causing it to panic.', '[{\"Name\": \"Ice Missile\", \"Type\": \"Ice\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 3, \"Description\": \"Creates ice lances in the air that fly towards enemies.\"}, {\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}, {\"Name\": \"Iceberg\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Summons a sharp ice lance under an enemy.\"}, {\"Name\": \"Crystal Breath\", \"Type\": \"Ice\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Enshrouds an e