(180, '-01', '/public/images/pals/T_RaijinDaughter_Water_icon_normal.png', 'Dazzi Noct', 'None', 'None', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}, {\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Dazzi Cloud\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Dark Fragment\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Lightning Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Lady of Dark Lightning\", \"Tech\": \"Dazzi Noct\'s Necklace\", \"Description\": \"While in team, appears near the player. Follows up player attacks with dark lightning bolts.\"}', 'Often kind to lonely Pals,  it plots to lure them into dropping their guard before striking them down. Yet, unable to find the right moment, it ends up making friends with them instead.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Dark Arrow\", \"Type\": \"Dark\", \"Level\": 15, \"Po