(182, '-01', '/public/images/pals/T_Werewolf_Ice_icon_normal.png', 'Loupmoon Cryst', 'None', 'None', '[{\"Name\": \"Ice\", \"Image\": \"/public/images/elements/T_Icon_element_s_08.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Cooling\", \"Image\": \"/public/images/suitability/T_icon_palwork_10.png\", \"Level\": 3}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Bone\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Claw\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Ice Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Frozen Gleam Strike\", \"Tech\": null, \"Description\": \"When activated, attacks targeted enemy with a powerful Snow Claw.\"}', 'The horns on its head are made of a mysterious ice that never melts. Shaved ice made by breaking off a horn is truly exquisite, but both the one who tries it and Loupmoon Cryst end up with a headache.', '[{\"Name\": \"Ice Missile\", \"Type\": \"Ice\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 3, \"Description\": \"Creates ice lances in the air that fly towards enemies.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}, {\"Name\": \"Snow Claw\", \"Type\": \"Ice\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 7, \"Description\": \"<characterName id=|WereWolf_Ice|/>\'s exclusive skill. Leaps forward and attacks twice with vicious claws imbued with ice element.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}, {\"Name\": \"Icicle Bullet\", \"Type\": \"Ice\", \"Level\": 30, \"Power\": 110, \"Cooldown\": 35, \"Description\": \"Generates multiple sharp ice blocks in the sky and fires them at the enemy.\"}, {\"Name\": \"Icicle Line\", \"Type\": \"Ice\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Generates pillars of ice that move in a straight line in three directions.\"}, {\"Name\": \"Blizzard Spike\", \"Type\": \"Ice\", \"Level\": 50, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Creates a giant lump of ice and hurls it at an enemy. It deals damage to those in the surrounding area upon impact.\"}]', '{\"HP\": 96, \"Food\": 5, \"Speed\": {\"Run\": 600, \"Ride\": 800, \"Walk\": 175}, \"Attack\": {\"Melee\": 100, \"Ranged\": 105}, \"Defense\": 80, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 375, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS Werewolf Ice', 'Humanoid', 5, 5640, 'L', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_Werewolf_Ice_day.png\", \"night\": \"/public/images/maps/BOSS_Werewolf_Ice_night.png\"}', 'Boss', 0, 1, 0, 0, 0, 0, '{\"Name\": \"Loupmoon Cryst Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_Werewolf_Ice.png\", \"Description\": \"Proof of defeating [Loupmoon Cryst, Enraptured by the Frozen Moonlight]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(183, '-01', '/public/images/pals/T_WhiteTiger_Ground_icon_normal.png', 'Cryolinx Terra', 'None', 'None', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Ore\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Claw\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Earth Resistance +2\", \"Rate\": 1.0}]', '{\"Name\": \"Electro Hunter\", \"Tech\": null, \"Description\": \"While fighting together, Electric Pals drop more items when defeated.\"}', 'It can easily carry many items with its large hands.  However, its short legs slow its pace,  often leaving it overtaken by nightfall.', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Stone Claw\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 95, \"Cooldown\": 17, \"Description\": \"Cryolinx Terra\'s exclusive skill. First, it strikes with its claws, followed by a second slash, and culminates with a powerful slash using its entire body. When swinging the claws, rocks are launched forward in a fan shape.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}, {\"Name\": \"Stone Beat\", \"Type\": \"Earth\", \"Level\": 50, \"Power\": 170, \"Cooldown\": 60, \"Description\": \"Shakes the ground and lifts a massive boulder into the air.\"}]', '{\"HP\": 120, \"Food\": 7, \"Speed\": {\"Run\": 720, \"Ride\": 900, \"Walk\": 280}, \"Attack\": {\"Melee\": 100, \"Ranged\": 105}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 460, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS WhiteTiger Ground', 'Humanoid', 8, 18320, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_WhiteTiger_Ground_day.png\", \"night\": \"/public/images/maps/BOSS_WhiteTiger_Ground_night.png\"}', 'Boss', 0, 1, 0, 0, 0, 0, '{\"Name\": \"Cryolinx Terra Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_WhiteTiger_Ground.png\", \"Description\": \"Proof of defeating [Cryolinx Terra, Predator of the Earth]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(184, '-01', '/public/images/pals/T_Horus_Water_icon_normal.png', 'Faleris Aqua', 'https://palworld.fandom.com/wiki/Faleris_Aqua', 'https://static.wikia.nocookie.net/palworld/images/2/22/Faleris_Aqua.png', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 4}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 4, \"Min\": 2, \"Name\": \"Pal Fluids\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Plume\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Water Resistance +2\", \"Rate\": 3.0}]', '{\"Name\": \"Tidal Predator\", \"Tech\": \"Faleris Aqua Saddle\", \"Description\": \"Can be ridden as a flying mount. While fighting together, Fire Pals drop more items when defeated.\"}', 'When it finds its prey, it unleashes a mighty torrent, sweeping the entire area. More often than not, the prey gets swept away in the chaos,  leaving one to wonder whether this truly counts as hunting.', '[{\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Splash\", \"Type\": \"Water\", \"Level\": 22, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates a column of water that travels in a straight line.\"}, {\"Name\": \"Curtain Splash\", \"Type\": \"Water\", \"Level\": 30, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Continously creates walls made from water columns at the enemy\'s location.\"}, {\"Name\": \"Phoenix Tide\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 135, \"Cooldown\": 28, \"Description\": \"Faleris Aqua\'s exclusive skill. After summoning a massive tornado, it envelops its body in water and charges forward.\"}, {\"Name\": \"Hydro Laser\", \"Type\": \"Water\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Shoots pressurized water at extreme velocities, sweeping over a wide area in front of it.\"}]', '{\"HP\": 120, \"Food\": 8, \"Speed\": {\"Run\": 1000, \"Ride\": 1400, \"Walk\": 200}, \"Attack\": {\"Melee\": 100, \"Ranged\": 110}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 500, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS Horus Water', 'Bird', 8, 14520, 'XL', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_Horus_Water_day.png\", \"night\": \"/public/images/maps/BOSS_Horus_Water_night.png\"}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Faleris Aqua Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_Horus_Water.png\", \"Description\": \"Proof of defeating [Faleris Aqua, Sentinel of the Tides]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(185, '-01', '/public/images/pals/T_FengyunDeeper_Electric_icon_norma.png', 'Fenglope Lux', 'None', 'None', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 3, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Horn\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Lightning Resistance +2\", \"Rate\": 1.0}]', '{\"Name\": \"Stormcloud\", \"Tech\": \"Fenglope Lux Saddle\", \"Description\": \"Can be ridden. Can double jump while mounted. While fighting together,  Water Pals drop more items when defeated.\"}', 'In ages past, it was believed that  drawing a picture of Fenglope Lux would result in being struck down by lightning.  As time passes, artworks depicting Fenglope Lux became revered as  charms to ward off lightning, making them a common presence.', '[{\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Thunder Tempest\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 90, \"Cooldown\": 15, \"Description\": \"Charges forward while manipulating the atmosphere  and enveloping itself in thunderclouds.\"}, {\"Name\": \"Thunder Rain\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 135, \"Cooldown\": 45, \"Description\": \"Calls lightning that strikes an enemy after a set amount of time has passed.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}, {\"Name\": \"Thunderstorm\", \"Type\": \"Electricity\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 60, \"Description\": \"Generates a huge tornado of lightning that moves slowly towards the enemy.\"}]', '{\"HP\": 132, \"Food\": 6, \"Speed\": {\"Run\": 750, \"Ride\": 1050, \"Walk\": 100}, \"Attack\": {\"Melee\": 100, \"Ranged\": 115}, \"Defense\": 90, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 417, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS FengyunDeeper Electric', 'FourLegged', 5, 5440, 'L', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_FengyunDeeper_Electric_day.png\", \"night\": \"/public/images/maps/BOSS_FengyunDeeper_Electric_night.png\"}', 'Boss', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Fenglope Lux Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_FengyunDeeper_Electric.png\", \"Description\": \"Proof of defeating [Fenglope Lux, Drifting Thundercloud]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(186, '-01', '/public/images/pals/T_AmaterasuWolf_Dark_icon_normal.png', 'Kitsun Noct', 'None', 'None', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 2}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Flame Organ\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Dark Fragment\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Dark Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Fogged Mind\", \"Tech\": \"Kitsun Noct Saddle\", \"Description\": \"Can be ridden. Applies Dark damage to the player\'s attacks while mounted.\"}', 'Despite its appearance, Kitsun Noct is extremely sensitive and will flee into a cave when spooked. It has become quite gloomy from being a shut-in for too long.', '[{\"Name\": \"Dark Cannon\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 50, \"Cooldown\": 2, \"Description\": \"Hurls an energy ball imbued with dark energy at an enemy.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Daring Shadowstorm\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 10, \"Description\": \"Kitsun Noct\'s exclusive skill. Charges forward with great speed while enveloped in intense purple flames.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Flame Funnel\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Creates multiple spheres of fiery energy, from which countless fireballs shoot towards the enemy.\"}, {\"Name\": \"Dark Whisp\", \"Type\": \"Dark\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 45, \"Description\": \"Fires a menacing ball of dark energy that pursues enemies.\"}]', '{\"HP\": 120, \"Food\": 4, \"Speed\": {\"Run\": 700, \"Ride\": 900, \"Walk\": 130}, \"Attack\": {\"Melee\": 100, \"Ranged\": 115}, \"Defense\": 105, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 415, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS AmaterasuWolf Dark', 'FourLegged', 8, 6340, 'L', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_AmaterasuWolf_Dark_day.png\", \"night\": \"/public/images/maps/BOSS_AmaterasuWolf_Dark_night.png\"}', 'Boss', 1, 1, 0, 0, 0, 0, '{\"Name\": \"Kitsun Noct Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_AmaterasuWolf_Dark.png\", \"Description\": \"Proof of defeating [Kitsun Noct, Guardian of the Dark Flame]. Simply possessing it permanently increases the stats of the Pals in your team.\"}'),
(187, '-01', '/public/images/pals/T_PinkRabbit_Grass_icon_normal.png', 'Ribbuny Botan', 'None', 'None', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 6, \"Min\": 4, \"Name\": \"Ancient Civilization Parts\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Beautiful Flower\", \"Rate\": 5.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ribbuny Ribbon\", \"Rate\": 50.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Precious Pelt\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Ring of Grass Resistance +1\", \"Rate\": 3.0}]', '{\"Name\": \"Grass Weaver\", \"Tech\": null, \"Description\": \"While in team, increases attack power of Grass Pals. While at a base, increases work efficiency if working at Weapon Workbench.\"}', 'Always wears a cheerful smile. Sometimes, thanks to Cattiva\'s pranks,  they end up tangled in tentacles and have to fight their way out! Even in tough situations, they keep smiling cheerfully.', '[{\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Seed Machine Gun\", \"Type\": \"Leaf\", \"Level\": 15, \"Power\": 50, \"Cooldown\": 9, \"Description\": \"Fires a volley of hard seeds at enemies in front of it.\"}, {\"Name\": \"Seed Mine\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Launches a deadly seed. If it hits an enemy, the seed explodes.\"}, {\"Name\": \"Wind Edge\", \"Type\": \"Leaf\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Launches sharp blades of air that fan out.\"}, {\"Name\": \"Circle Vine\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Sprouts sharp roots in and around the enemy\'s location.\"}, {\"Name\": \"Solar Blast\", \"Type\": \"Leaf\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges solar energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 96, \"Food\": 2, \"Speed\": {\"Run\": 245, \"Ride\": 350, \"Walk\": 100}, \"Attack\": {\"Melee\": 100, \"Ranged\": 65}, \"Defense\": 70, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 172, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 0.24}', 'BOSS PinkRabbit Grass', 'Humanoid', 5, 3240, 'M', 'FieldBoss', '{\"day\": \"/public/images/maps/BOSS_PinkRabbit_Grass_day.png\", \"night\": \"/public/images/maps/BOSS_PinkRabbit_Grass_night.png\"}', 'NotInterested', 0, 0, 0, 0, 0, 0, '{\"Name\": \"Ribbuny Botan Bounty Token\", \"Image\": \"/public/images/other/T_icon_item_BossDefeatReward_PinkRabbit_Grass.png\", \"Description\": \"Proof of defeating [Ribbuny Botan, Sparkling Smile]. Simply possessing it permanently increases the stats of the Pals in your team\"}');
