(48, 'ItemChest', 'Wooden Chest', 'Stores items. Made from wood, it breaks easily. It\'s probably not the best thing to store valuables in.', '/public/images/build/T_icon_buildObject_ItemChest.png', '[{\"Name\": \"Wood\", \"Amount\": 15}, {\"Name\": \"Stone\", \"Amount\": 5}]', 'Storage', 1000, 0, 0, 0),
(49, 'ItemChest_02', 'Metal Chest', 'Stores items. Reinforced with metal, it is somewhat durable. The increased size allows for the storage of more things.', '/public/images/build/T_icon_buildObject_ItemChest_02.png', '[{\"Name\": \"Ingot\", \"Amount\": 15}, {\"Name\": \"Wood\", \"Amount\": 30}]', 'Storage', 8000, 0, 0, 0),
