(55, 'ElectricHeater', 'Electric Heater', 'A device that blows warm air, raising the temperature of a base. Using electricity, it can really heat things up. Requires a Fire Pal to light a flame.', '/public/images/build/T_icon_buildObject_HeaterElectric.png', '[{\"Name\": \"Refined Ingot\", \"Amount\": 30}, {\"Name\": \"Circuit Board\", \"Amount\": 10}, {\"Name\": \"Ingot\", \"Amount\": 30}, {\"Name\": \"Flame Organ\", \"Amount\": 10}]', 'Infrastructure', 100000, 0, 0, 0),
