(57, 'ElectricCooler', 'Electric Cooler', 'A device that blows cool air, lowering the temperature of a base. Using electricity, it can really lower the temperature. Requires an Ice Pal for cooling.', '/public/images/build/T_icon_buildObject_CoolerElectric.png', '[{\"Name\": \"Refined Ingot\", \"Amount\": 30}, {\"Name\": \"Circuit Board\", \"Amount\": 10}, {\"Name\": \"Ingot\", \"Amount\": 30}, {\"Name\": \"Ice Organ\", \"Amount\": 10}]', 'Infrastructure', 100000, 0, 0, 1),
