(60, 'Lamp', 'Lamp', 'A light source that provides illumination to a base even at night. Requires electricity, but lights up a larger area.', '/public/images/build/T_icon_buildObject_LampStand.png', '[{\"Name\": \"Ingot\", \"Amount\": 10}, {\"Name\": \"Electric Organ\", \"Amount\": 3}, {\"Name\": \"Nail\", \"Amount\": 3}, {\"Name\": \"Wood\", \"Amount\": 20}]', 'Lighting', 7000, 0, 0, 1),
