(62, 'LargeLamp', 'Large Mounted Lamp', 'A light source that provides illumination to a base even at night. Requires a significant amount of electricity, but lights up an even larger area.', '/public/images/build/T_icon_buildObject_LampStandLarge.png', '[{\"Name\": \"Ingot\", \"Amount\": 50}, {\"Name\": \"Circuit Board\", \"Amount\": 5}, {\"Name\": \"Nail\", \"Amount\": 5}]', 'Lighting', 30000, 0, 0, 1),
(63, 'LargeCeilingLamp', 'Large Ceiling Lamp', 'A light source that provides illumination to a base even at night. It can be placed on a ceiling. Requires a significant amount of electricity, but lights up an even larger area.', '/public/images/build/T_icon_buildObject_LampTopLarge.png', '[{\"Name\": \"Ingot\", \"Amount\": 50}, {\"Name\": \"Circuit Board\", \"Amount\": 5}, {\"Name\": \"Nail\", \"Amount\": 5}]', 'Lighting', 30000, 0, 0, 1),
(64, 'Trap_LegHold', 'Bear Trap (Small)', 'Trap that immobilizes Pals who step on it. The capture rate with the sphere increases when a Pal is trapped. Only effective on small Pals.', '/public/images/build/T_icon_buildObject_Trap_LegHold.png', '[{\"Name\": \"Ingot\", \"Amount\": 5}]', 'Defenses', 0, 0, 0, 0),
(65, 'Trap_LegHold_Big', 'Bear Trap (Large)', 'A bear trap to immobilize large Pals. The capture rate with the sphere increases when a Pal is trapped. Only effective on large Pals, small Pals will not be caught.', '/public/images/build/T_icon_buildObject_Trap_LegHold_Big.png', '[{\"Name\": \"Ingot\", \"Amount\": 20}]', 'Defenses', 0, 0, 0, 0),
(66, 'Trap_Noose', 'Hanging Trap', 'Trap that catches Pals passing through it. Pals caught in the trap are easier to catch with Spheres. Only effective on small Pals.', '/public/images/build/T_icon_buildObject_Trap_Noose.png', '[{\"Name\": \"Wood\", \"Amount\": 10}, {\"Name\": \"Stone\", \"Amount\": 5}]', 'Defenses', 0, 0, 0, 0),
