(1, '139', '/public/images/pals/T_BadCatgirl_icon_normal.png', 'Nyafia', 'https://palworld.fandom.com/wiki/Nyafia', 'https://static.wikia.nocookie.net/palworld/images/d/d9/Nyafia.png', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 3}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 2}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}]', '{\"Name\": \"Shot-Nyan Mode\", \"Tech\": \"Nyafia\'s Shotgun\", \"Description\": \"When activated,  Nyafia will fire a shotgun at nearby enemies for a limited time.\"}', 'Strongly dislikes anyone catching a glimpse of its concealed eye.  If you insist on trying, it\'ll burst into tears and ignore you for two weeks.', '[{\"Name\": \"Poison Fog\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 0, \"Cooldown\": 30, \"Description\": \"Generates a fog of poison in front,  causing the opponent to become poisoned.\"}, {\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Poison Shower\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Focuses energy into the body and scatters poison orbs in all directions.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 40, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Dark Laser\", \"Type\": \"Dark\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges dark energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 110, \"Food\": 3, \"Speed\": {\"Run\": 600, \"Ride\": 900, \"Walk\": 100}, \"Attack\": {\"Melee\": 100, \"Ranged\": 100}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 400, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'BadCatgirl', 'Humanoid', 4, 5180, 'M', '{\"day\": \"/public/images/maps/BadCatgirl_day.png\", \"night\": \"/public/images/maps/BadCatgirl_night.png\"}', '{\"Rank\": 645, \"Order\": 1, \"MaleProbability\": 40}', 'Warlike', 1, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(2, '138', '/public/images/pals/T_BlueberryFairy_icon_normal.png', 'Prunelia', 'https://palworld.fandom.com/wiki/Prunelia', 'https://static.wikia.nocookie.net/palworld/images/7/72/Prunelia.png', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}, {\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 3, \"Min\": 1, \"Name\": \"Low Grade Medical Supplies\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Beautiful Flower\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Carrot Seeds\", \"Rate\": 50.0}]', '{\"Name\": \"Prayer for Abundant Harvest\", \"Tech\": null, \"Description\": \"While at a base,  Prunelia\'s prayers bless the crops, increasing their harvest.\"}', 'Intelligent and graceful in its demeanor,  it was frequently employed as an attendant by the island\'s nobles. However, when encountered at night, its face looked so eerie that it quickly fell out of favor.', '[{\"Name\": \"Poison Fog\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 0, \"Cooldown\": 30, \"Description\": \"Generates a fog of poison in front,  causing the opponent to become poisoned.\"}, {\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Seed Mine\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Launches a deadly seed. If it hits an enemy, the seed explodes.\"}, {\"Name\": \"Poison Shower\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Focuses energy into the body and scatters poison orbs in all directions.\"}, {\"Name\": \"Spine Vine\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 95, \"Cooldown\": 25, \"Description\": \"Generates spiny thorns that chase an enemy along the ground, piercing them from below.\"}, {\"Name\": \"Solar Blast\", \"Type\": \"Leaf\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges solar energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 105, \"Food\": 3, \"Speed\": {\"Run\": 550, \"Ride\": 700, \"Walk\": 150}, \"Attack\": {\"Melee\": 100, \"Ranged\": 95}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 350, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'BlueberryFairy', 'Humanoid', 5, 6020, 'S', '{\"day\": \"/public/images/maps/BlueberryFairy_day.png\", \"night\": \"/public/images/maps/BlueberryFairy_night.png\"}', '{\"Rank\": 755, \"Order\": 2, \"MaleProbability\": 40}', 'Escape to Battle', 1, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(3, '140', '/public/images/pals/T_GoldenHorse_icon_normal.png', 'Gildane', 'https://palworld.fandom.com/wiki/Gildane', 'https://static.wikia.nocookie.net/palworld/images/4/42/Gildane.png', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Oil Extraction\", \"Image\": \"/public/images/suitability/T_icon_palwork_09.png\", \"Level\": 3}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}]', '{\"Name\": \"Sandstorm\'s Blessing\", \"Tech\": \"Gildane Saddle\", \"Description\": \"Can be ridden. Applies Ground damage to the player\'s attacks while mounted.\"}', 'During the golden age of alchemy on the island,  its ever-glowing golden fur was highly prized as a catalyst for transmuting gold. In time, a remarkable revelation was made:  the same golden hue could be achieved simply by processing its mane.', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Rockburst\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 130, \"Cooldown\": 35, \"Description\": \"Causes the ground to shake before hurling a massive stone mass at its surroundings.\"}, {\"Name\": \"Crash Dash\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 28, \"Description\": \"Gildane\'s exclusive skill. Charges forward, hurling rocks to the left and right with great force.\"}, {\"Name\": \"Stone Beat\", \"Type\": \"Earth\", \"Level\": 50, \"Power\": 170, \"Cooldown\": 60, \"Description\": \"Shakes the ground and lifts a massive boulder into the air.\"}]', '{\"HP\": 120, \"Food\": 7, \"Speed\": {\"Run\": 840, \"Ride\": 1260, \"Walk\": 270}, \"Attack\": {\"Melee\": 100, \"Ranged\": 110}, \"Defense\": 110, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": -1, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'GoldenHorse', 'FourLegged', 8, 8750, 'L', '{\"day\": \"/public/images/maps/GoldenHorse_day.png\", \"night\": \"/public/images/maps/GoldenHorse_night.png\"}', '{\"Rank\": 505, \"Order\": 3, \"MaleProbability\": 50}', 'Warlike', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(4, '100', '/public/images/pals/T_Anubis_icon_normal.png', 'Anubis', 'https://palworld.fandom.com/wiki/Anubis', 'https://static.wikia.nocookie.net/palworld/images/2/21/Anubis_menu.png/', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 4}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 2}]', '[{\"Max\": 5, \"Min\": 3, \"Name\": \"Bone\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Large Pal Soul\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Innovative Technical Manual\", \"Rate\": 5.0}]', '{\"Name\": \"Guardian of the Desert\", \"Tech\": \"Anubis\'s Power Converter\", \"Description\": \"When fighting together, applies Ground damage to the player\'s attacks. Sometimes dodges attacks with a high speed sidestep while in battle.\"}', 'Once seen as a symbol of nobility,  and an idol for those who shunned wealth and power. Yet over time, this Pal became a token of death.', '[{\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 1, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Spinning Roundhouse\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 100, \"Cooldown\": 21, \"Description\": \"Anubis\' exclusive skill. Performs a spin kick with its strong legs, sweeping enemies over a wide area.\"}, {\"Name\": \"Forceful Charge\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 120, \"Cooldown\": 28, \"Description\": \"Anubis\' exclusive skill. Rapidly pursues its foes while releasing energy and unleashing a powerful punch.\"}, {\"Name\": \"Ground Smash\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 140, \"Cooldown\": 35, \"Description\": \"Anubis\' exclusive skill. Leaps high into the air and strikes a punch to the ground,  causing a shockwave that deals damge over a wide area.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}]', '{\"HP\": 120, \"Food\": 6, \"Speed\": {\"Run\": 800, \"Ride\": 1000, \"Walk\": 160}, \"Attack\": {\"Melee\": 130, \"Ranged\": 130}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 480, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'Anubis', 'Humanoid', 10, 4960, 'M', '{\"day\": null, \"night\": null}', '{\"Rank\": 570, \"Order\": 4, \"MaleProbability\": 50}', 'Warlike', 0, 1, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(5, '040', '/public/images/pals/T_Baphomet_icon_normal.png', 'Incineram', 'https://palworld.fandom.com/wiki/Incineram', 'https://static.wikia.nocookie.net/palworld/images/4/40/Incineram_menu.png/', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}, {\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 2}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Horn\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}]', '{\"Name\": \"Flameclaw Hunter\", \"Tech\": null, \"Description\": \"When activated, attacks targeted enemy with a powerful Hellfire Claw.\"}', 'In the dark of night, this Pal snatches prey to bring back to its territory. What happens to those poor souls afterwards isn\'t too hard to imagine.', '[{\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Flare Arrow\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires three flaming arrows in succession that home in on an enemy.\"}, {\"Name\": \"Hellfire Claw\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 10, \"Description\": \"Incineram\'s exclusive skill. Draws near enemies using it