(13, '037B', '/public/images/pals/T_Deer_Ground_icon_normal.png', 'Eikthyrdeer Terra', 'https://palworld.fandom.com/wiki/Eikthyrdeer_Terra', 'https://static.wikia.nocookie.net/palworld/images/3/32/Eikthyrdeer_Terra_menu.png', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 2, \"Min\": 2, \"Name\": \"Eikthyrdeer Venison\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Horn\", \"Rate\": 100.0}]', '{\"Name\": \"Guardian of the Golden Forest\", \"Tech\": \"Eikthyrdeer Terra Saddle\", \"Description\": \"Can be ridden. Can perform a double jump while mounted. Increases efficiency of cutting trees.\"}', 'The individual with the hardest horns becomes the leader. Once the horns are lost, so too is its leadership status. It leaves the herd amidst farewell glances and quietly returns to the earth.', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Antler Uppercut\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 50, \"Cooldown\": 5, \"Description\": \"Eikthyrdeer\'s exclusive skill. Charges at foes and uses antlers to launch them into the air. When used while riding, the direction of the charge can be controlled.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 30, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\