(14, '067', '/public/images/pals/T_DrillGame_icon_normal.png', 'Digtoise', 'https://palworld.fandom.com/wiki/Digtoise', 'https://static.wikia.nocookie.net/palworld/images/5/5b/Digtoise_menu.png/', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 3}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Ore\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"High Quality Pal Oil\", \"Rate\": 100.0}]', '{\"Name\": \"Drill Crusher\", \"Tech\": \"Digtoise\'s Headband\", \"Description\": \"When activated, performs Shell Spin, follows the player while spinning, and mines ores efficiently.\"}', 'A Digtoise possessing the strongest shell and the only drill capable of piercing it, ponders the contradictions of the world in the popular children\'s tale, |Digtoise\'s Fable|.', '[{\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Shell Spin\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 65, \"Cooldown\": 9, \"Description\": \"Digtoise\'s exclusive skill. Moves while spinning its whole body at high speed. Drills through enemies, dealing continuous damage.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Aqua Burst\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of water and hurls i