(15, '047', '/public/images/pals/T_Eagle_icon_normal.png', 'Galeclaw', 'https://palworld.fandom.com/wiki/Galeclaw', 'https://static.wikia.nocookie.net/palworld/images/0/08/Galeclaw_menu.png/', '[{\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Galeclaw Poultry\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}]', '{\"Name\": \"Galeclaw Glider\", \"Tech\": \"Galeclaw\'s Gloves\", \"Description\": \"While in team, can be summoned and used instead of a glider. Allows you to fire a gun while gliding with this Pal.\"}', 'A Pal that can easily take flight even while grasping a human. It is, however, prone to letting go when tired, which has led to the sudden demise of more than a few souls.', '[{\"Name\": \"Gale Claw\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 60, \"Cooldown\": 8, \"Description\": \"Galeclaw\'s exclusive skill. With talons outstretched,  it glides forward in a ferocious charge.\"}, {\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two tornadoes on either side before