(16, '103', '/public/images/pals/T_ElecPanda_icon_normal.png', 'Grizzbolt', 'https://palworld.fandom.com/wiki/Grizzbolt', 'https://static.wikia.nocookie.net/palworld/images/1/13/Grizzbolt_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 4, \"Min\": 2, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}]', '{\"Name\": \"Yellow Tank\", \"Tech\": \"Grizzbolt\'s Minigun\", \"Description\": \"Can be ridden. Can rapidly fire a minigun while mounted.\"}', 'With a friendly smile and a hardy physique, it is docile towards one it recognizes as a partner. For reasons unexplained, its personality undergoes a drastic change when wielding a minigun.', '[{\"Name\": \"Spark Blast\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Releases lightning orbs in a fan shape,  spreading as they travel.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Lightning Claw\", \"Type\": \"Electricity\", \"Level\": 15, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Grizzbolt\'s exclusive skill. After leaping at an enemy and tearing at it twice with its electrically charged claws, it attacks the ground, sending an electric shock throughout the area.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Lightning Strike\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Acts as a lightning rod, calling down thunderbolts that electrocute the surrounding area.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}]', '{\"HP\": 105, \"Food\": 7, \"Speed\": {\"Run\": 470, \"Ride\": 550, \"Walk\": 140}, \"Attack\": {\"Melee\": 120, \"Ranged\": 100}, \"Defense\": 100, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 210, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'ElecPanda', 'Humanoid', 8, 7720, 'L', '{\"day\": \"/public/images/maps/ElecPanda_day.png\", \"night\": \"/public/images/maps/ElecPanda_night.png\"}', '{\"Rank\": 200, \"Order\": 16, \"MaleProbability\": 50}', 'Warlike', 0, 1, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}');
