(21, '012', '/public/images/pals/T_Hedgehog_icon_normal.png', 'Jolthog', 'https://palworld.fandom.com/wiki/Jolthog', 'https://static.wikia.nocookie.net/palworld/images/5/52/Jolthog_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Jolt Bomb\", \"Tech\": \"Jolthog\'s Gloves\", \"Description\": \"When activated, equips Jolthog to the player\'s hand. When thrown at an enemy, causes an electrical explosion upon impact.\"}', 'It releases the electricity stored in its body when under attack. The voltage it generates exceeds 10 million volts, making it more lethal than any conventional heavy firearms when thrown.', '[{\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Electric Ball\", \"Type\": \"Electricity\", \"Level\": 15, \"Power\": 50, \"Cooldown\": 9, \"Description\": \"Fires an electric ball that slowly pursues an enemy.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Light