(27, '010', '/public/images/pals/T_Penguin_icon_normal.png', 'Pengullet', 'https://palworld.fandom.com/wiki/Pengullet', 'https://static.wikia.nocookie.net/palworld/images/3/38/Pengullet_menu.png/', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}, {\"Name\": \"Ice\", \"Image\": \"/public/images/elements/T_Icon_element_s_08.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Cooling\", \"Image\": \"/public/images/suitability/T_icon_palwork_10.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Ice Organ\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Pal Fluids\", \"Rate\": 100.0}]', '{\"Name\": \"Pengullet Cannon\", \"Tech\": \"Pengullet Rocket Launcher\", \"Description\": \"When activated, the player equips a Rocket Launcher and fires Pengullet as ammunition. Pengullet explodes on contact and is incapacitated.\"}', 'The feathers of this Pal have all but disappeared, but sadly, its desire to fly has remained as strong as ever. Even now, it tries to fly again in any way it can.', '[{\"Name\": \"Ice Missile\", \"Type\": \"Ice\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 3, \"Description\": \"Creates ice lances in the air that fly towards enemies.\"}, {\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}, {\"Name\": \"Iceberg\", \"Type\": \"Ice\", \"Level\": 30, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Summons a sharp ice lance under an enemy.\"}, {\"Name\": \"Blizzard Spike\", \"Type\": \"Ice\", \"Level\": 40, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Creates a giant lump of ice and hurls it at an enemy. It deals damage to those in the surrounding area upon impact.\"}, {\"Name\": \"Hydro Laser\", \"Type\": \"Water\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Shoots pressurized water at extreme velocities, sweeping over a wide area in front of it.\"}]', '{\"HP\": 70, \"Food\": 2, \"Speed\": {\"Run\": 500, \"Ride\": 650, \"Walk\": 60}, \"Attack\": {\"Melee\": 70, \"Ranged\": 75}, \"Defense\": 70, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 265, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'Penguin', 'Humanoid', 1, 1080, 'XS', '{\"day\": \"/public/images/maps/Penguin_day.png\", \"night\": \"/public/images/maps/Penguin_night.png\"}', '{\"Rank\": 1350, \"Order\": 27, \"MaleProbability\": 50}', 'Escape to Battle', 0, 0, 1, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(28, '062', '/public/images/pals/T_RaijinDaughter_icon_normal.png', 'Dazzi', 'https://palworld.fandom.com/wiki/Dazzi', 'https://static.wikia.nocookie.net/palworld/images/b/b0/Dazzi_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Dazzi Cloud\", \"Rate\": 100.0}]', '{\"Name\": \"Lady of Lightning\", \"Tech\": \"Dazzi\'s Necklace\", \"Description\": \"While in team, appears near the player. Follows up player attacks with lightning bolts.\"}', 'Often kind to lonely Pals. However, the moment a Pal mistakes this for actual friendship, it seizes the opportunity to blast them with a thunderbolt.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times fr