(29, '031', '/public/images/pals/T_SharkKid_icon_normal.png', 'Gobfin', 'https://palworld.fandom.com/wiki/Gobfin', 'https://static.wikia.nocookie.net/palworld/images/f/ff/Gobfin_menu.png/', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 2}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Pal Fluids\", \"Rate\": 100.0}]', '{\"Name\": \"Angry Shark\", \"Tech\": null, \"Description\": \"When activated, attacks targeted enemy with a powerful Aqua Gun. While in team, increases player\'s attack power.\"}', 'Long ago, it was a giant and powerful aquatic Pal. However, as food became scarce, it evolved to live on land. Since walking requires much energy, it gradually became smaller and is now a small and puny Pal.', '[{\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 22, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Icicle Cutter\", \"Type\": \"Ice\", \"Level\": 30, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Creates a crescent blade of ice and hurls it forward.\"}, {\"Name\": \"Aqua Burst\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 100, \"Cooldown\": 30, \"De