(30, '031B', '/public/images/pals/T_SharkKid_Fire_icon_normal.png', 'Gobfin Ignis', 'https://palworld.fandom.com/wiki/Gobfin_Ignis', 'https://static.wikia.nocookie.net/palworld/images/9/9c/Gobfin_Ignis_menu.png', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 2}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Flame Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Angry Shark\", \"Tech\": null, \"Description\": \"When activated, attacks targeted enemy with a powerful Spirit Fire. While in team, increases player\'s attack power.\"}', 'Long ago, it was a giant and powerful aquatic Pal. However, as food became scarce, it evolved to live on land. Since walking burns many calories, it astonishingly awakened its power to control fire!', '[{\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Flare Arrow\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires three flaming arrows in succession that home in on an enemy.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Fire Ball\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Creates a giant ball of flame and hurls it at an enemy. The ball explodes over a wide area upon impact.\"}, {\"Name\": \"Ignis Rage\", \"Type\": \"Fire\", \"Level\": 50, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Infuses the surrounding ground with energy,  causing it to explode after a set amount of time.\"}]', '{\"HP\": 90, \"Food\": 3, \"Speed\": {\"Run\": 400, \"Ride\": 500, \"Walk\": 80}, \"Attack\": {\"Melee\": 90, \"Ranged\": 90}, \"Defense\": 75, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 120, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'SharkKid Fire', 'Humanoid', 3, 1800, 'S', '{\"day\": \"/public/images/maps/SharkKid_Fire_day.png\", \"night\": \"/public/images/maps/SharkKid_Fire_night.png\"}', '{\"Rank\": 1100, \"Order\": 30, \"MaleProbability\": 50}', 'Warlike', 0, 1, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
