(49, '082', '/public/images/pals/T_BlueDragon_icon_normal.png', 'Azurobe', 'https://palworld.fandom.com/wiki/Azurobe', 'https://static.wikia.nocookie.net/palworld/images/a/a0/Azurobe_menu.png/', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}, {\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 3}]', '[{\"Max\": 3, \"Min\": 1, \"Name\": \"Cloth\", \"Rate\": 100.0}]', '{\"Name\": \"Waterwing Dance\", \"Tech\": \"Azurobe Saddle\", \"Description\": \"Can be ridden to travel on water. Applies Water damage to the player\'s attacks while mounted.\"}', 'This Pal\'s white ribbon turns black if doused with impure water. Given its usefulness in detecting poison, this Pal was once overhunted. This past has left them bitter towards humanity.', '[{\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Dragon Cannon\", \"Type\": \"Dragon\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls an energy ball imbued with draconic energy at an enemy.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Dragon Burst\", \"Type\": \"Dragon\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges draconic energy, damaging those around it.\"}, {\"Name\": \"Draconic Breath\", \"Type\": \"Dragon\", \"Level\": 30, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Exhales breath imbued with draconic energy, dealing continuous damage to those in front of it.\"}, {\"Name\": \"Hydro Laser\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Shoots pressurized water at extreme vel