(52, '093', '/public/images/pals/T_FengyunDeeper_icon_normal.png', 'Fenglope', 'https://palworld.fandom.com/wiki/Fenglope', 'https://static.wikia.nocookie.net/palworld/images/6/68/Fenglope_menu.png/', '[{\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 3, \"Min\": 3, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Horn\", \"Rate\": 100.0}]', '{\"Name\": \"Wind and Clouds\", \"Tech\": \"Fenglope Saddle\", \"Description\": \"Can be ridden. Can double jump while mounted.\"}', 'In ages past, its beautiful visage was a common sight in paintings. As time passed, its beautiful pelt and antlers were often seen in works of art.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Cloud Tempest\", \"Type\": \"Neutral\", \"Level\": 15, \"Power\": 90, \"Cooldown\": 15, \"Description\": \"Fenglope\'s exclusive skill. Charges forward while manipulating the atmosphere to create a pressurized wind tunnel around itself.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 22, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Aqua Burst\", \"Type\": \"Water\", \"Level\": 30, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of water and hurls it at an enemy.\"}, {\"Name\": \"Blizzard Spike\", \"Type\": \"Ice\", \"Level\": 40, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Creates a giant lump of ice and hurls it at an enemy. It deals damage to those in the surrounding area upon impact.\"}, {\"N