(63, '006', '/public/images/pals/T_BluePlatypus_icon_normal.png', 'Fuack', 'https://palworld.fandom.com/wiki/Fuack', 'https://static.wikia.nocookie.net/palworld/images/5/5e/Fuack_menu.png/', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Pal Fluids\", \"Rate\": 100.0}]', '{\"Name\": \"Surfing Slam\", \"Tech\": null, \"Description\": \"When activated, Fuack body surfs towards an enemy and slams into them.\"}', 'Using its own body water, this Pal can create waves anywhere. It body surfs when in a hurry, but the resulting speed often ends in a fatal collision.', '[{\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Ice Missile\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 30, \"Cooldown\": 3, \"Description\": \"Creates ice lances in the air that fly towards enemies.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 30, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Aqua Burst\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of water and hurls it at an enemy.\"}, {\"Name\": \"Hydro Laser\", \"Type\": \"Water\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Shoots pressurized water at extreme velocities, sweeping over a wide area in front of it.\"}]', '{\"HP\": 60, \"Food\": 2, \"Speed\": {\"Run\": 300, \"Ride\": 400, \"Walk\": 105}, \"Attack\": {\"Melee\": 80, \"Ranged\": 80}, \"Defense\": 60, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 202, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.3}', 'BluePlatypus', 'Humanoid', 1, 1120, 'XS', '{\"day\": \"/public/images/maps/BluePlatypus_day.png\", \"night\": \"/public/images/maps/BluePlatypus_night.png\"}', '{\"Rank\": 1330, \"Order\": 63, \"MaleProbability\": 50}', 'Escape to Battle', 0, 0, 1, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
