(66, '003', '/public/images/pals/T_ChickenPal_icon_normal.png', 'Chikipi', 'https://palworld.fandom.com/wiki/Chikipi', 'https://static.wikia.nocookie.net/palworld/images/f/f4/Chikipi_menu.png/', '[{\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 1}, {\"Type\": \"Farming\", \"Image\": \"/public/images/suitability/T_icon_palwork_12.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Egg\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Chikipi Poultry\", \"Rate\": 100.0}]', '{\"Name\": \"Egg Layer\", \"Tech\": null, \"Description\": \"Sometimes lays an Egg when assigned to Ranch.\"}', 'Extremely weak and far too delicious. It is one of the weakest Pals alongside Lamball. No matter how many are hunted, they just keep appearing.', '[{\"Name\": \"Chicken Rush\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 1, \"Description\": \"Chikipi\'s exclusive skill. Flies at enemies in its sights, attacking them with its sharp beak.\"}, {\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 15, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Implode\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 230, \"Cooldown\": 55, \"Description\": \"Risks its life to cause a violent explosion. Becomes incapacitated afterwards.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side 