(67, '064', '/public/images/pals/T_FlowerDinosaur_icon_normal.png', 'Dinossom', 'https://palworld.fandom.com/wiki/Dinossom', 'https://static.wikia.nocookie.net/palworld/images/b/b7/Dinossom_menu.png/', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}, {\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Wheat Seeds\", \"Rate\": 50.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Carrot Seeds\", \"Rate\": 50.0}]', '{\"Name\": \"Fragrant Dragon\", \"Tech\": \"Dinossom Saddle\", \"Description\": \"Can be ridden. Enhances Grass attacks while mounted.\"}', 'A Pal who once angered cannot be pacified. It rages on and on like an inferno. The phrase |step on a Dinossom\'s tail| has come to mean enraging someone.', '[{\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Botanical Smash\", \"Type\": \"Leaf\", \"Level\": 7, \"Power\": 60, \"Cooldown\": 8, \"Description\": \"Dinossom\'s exclusive skill. Uses its large tail to strike the ground in front of it,  delivering a shockwave in a straight line.\"}, {\"Name\": \"Dragon Burst\", \"Type\": \"Dragon\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges draconic energy, damaging those around it.\"}, {\"Name\": \"Seed Mine\", \"Type\": \"Leaf\", \"Level\": 22, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Launches a deadly seed. If it hits an enemy, the seed explodes.\"}, {\"Name\": \"Draconic Breath\", \"Type\": \"Dragon\", \"Level\": 30, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Exhales breath imbued with draconic energy, dealing continuous damage to those in front of it.\"}, {\"Name\": \"Spine Vine\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 95, \"Cooldown\": 25, \"Description\": \"Generates spiny thorns that chase an enemy along the ground, piercing them from below.\"}, {\"Name\": \"Solar Blast\", \"Type\": \"Leaf\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges solar energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 110, \"Food\": 6, \"Speed\": {\"Run\": 550, \"Ride\": 700, \"Walk\": 120}, \"Attack\": {\"Melee\": 90, \"Ranged\": 85}, \"Defense\": 90, \"Stamina\": 100, \"Support\": 150, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 335, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'FlowerDinosaur', 'Humanoid', 6, 3240, 'L', '{\"day\": \"/public/images/maps/FlowerDinosaur_day.png\", \"night\": \"/public/images/maps/FlowerDinosaur_night.png\"}', '{\"Rank\": 820, \"Order\": 67, \"MaleProbability\": 50}', 'Friendly', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(68, '064B', '/public/images/pals/T_FlowerDinosaur_Electric_icon_normal.png', 'Dinossom Lux', 'https://palworld.fandom.com/wiki/Dinossom_Lux', 'https://static.wikia.nocookie.net/palworld/images/c/c7/Dinossom_Lux_menu.png', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}, {\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Tomato Seeds\", \"Rate\": 50.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Carrot Seeds\", \"Rate\": 50.0}]', '{\"Name\": \"Thunder Dragon\", \"Tech\": \"Dinossom Lux Saddle\", \"Description\": \"Can be ridden. Enhances Electric attacks while mounted.\"}', 'Though struck by lightning, it lives on. The phrase |struck by a Dinossom Lux\'s bolt| has come to mean narrowly escaping death.', '[{\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Plasma Funnel\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Creates two balls of electric energy that fire numerous lightning orbs at enemies.\"}, {\"Name\": \"Botanical Smash\", \"Type\": \"Leaf\", \"Level\": 15, \"Power\": 60, \"Cooldown\": 8, \"Description\": \"Dinossom\'s exclusive skill. Uses its large tail to strike the ground in front of it,  delivering a shockwave in a straight line.\"}, {\"Name\": \"Draconic Breath\", \"Type\": \"Dragon\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Exhales breath imbued with draconic energy, dealing continuous damage to those in front of it.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Lightning Strike\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Acts as a lightning rod, calling down thunderbolts that electrocute the surrounding area.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}]', '{\"HP\": 110, \"Food\": 6, \"Speed\": {\"Run\": 550, \"Ride\": 700, \"Walk\": 120}, \"Attack\": {\"Melee\": 90, \"Ranged\": 90}, \"Defense\": 90, \"Stamina\": 100, \"Support\": 150, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 335, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'FlowerDinosaur Electric', 'Humanoid', 7, 3380, 'L', '{\"day\": \"/public/images/maps/FlowerDinosaur_Electric_day.png\", \"night\": \"/public/images/maps/FlowerDinosaur_Electric_night.png\"}', '{\"Rank\": 810, \"Order\": 68, \"MaleProbability\": 50}', 'Friendly', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(69, '007', '/public/images/pals/T_ElecCat_icon_normal.png', 'Sparkit', 'https://palworld.fandom.com/wiki/Sparkit', 'https://static.wikia.nocookie.net/palworld/images/c/ce/Sparkit_menu.png/', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 1}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 2, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Static Electricity\", \"Tech\": null, \"Description\": \"While in team, increases attack power of Electric Pals.\"}', 'During the dry season, this Pal is always on the verge of blowing a fuse. Sparks can fly with even the slightest provocation, even amongst allies.', '[{\"Name\": \"Spark Blast\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Releases lightning orbs in a fan shape,  spreading as they travel.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Electric Ball\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 50, \"Cooldown\": 9, \"Description\": \"Fires an electric ball that slowly pursues an enemy.\"}, {\"Name\": \"Tri-Lightning\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates lightning that strikes an enemy three times from above.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 75, \"Cooldown\": 16, \"Description\"