(77, '105', '/public/images/pals/T_Horus_icon_normal.png', 'Faleris', 'https://palworld.fandom.com/wiki/Faleris', 'https://static.wikia.nocookie.net/palworld/images/9/99/Faleris_menu.png/', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 4, \"Min\": 1, \"Name\": \"Flame Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Scorching Predator\", \"Tech\": \"Faleris Saddle\", \"Description\": \"Can be ridden as a flying mount. While fighting together, Ice Pals drop more items when defeated.\"}', 'When it finds its prey it unleashes a whirlwind of flames, burning the entire area to ash. Faleris breath is known for its pleasing scent.', '[{\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}, {\"Name\": \"Flare Arrow\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires three flaming arrows in succession that home in on an enemy.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Ignis Breath\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Shoots flames at an enemy, dealing continuous damage.\"}, {\"Name\": \"Phoenix Flare\", \"Type\": \"Fire\", \"Level\": 30, \"Power\": 135, \"Cooldown\": 28, \"Description\": \"Faleris\' exclusive skill. After creating scorching tornadoes, it cloaks itself in hellfire and charges forward.\"}, {\"Name\": \"Ignis Rage\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 120, \"Cooldown\": 4