(78, '096', '/public/images/pals/T_KingBahamut_icon_normal.png', 'Blazamut', 'https://palworld.fandom.com/wiki/Blazamut', 'https://static.wikia.nocookie.net/palworld/images/e/ee/Blazamut_menu.png/', '[{\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 3}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 4}]', '[{\"Max\": 10, \"Min\": 10, \"Name\": \"Coal\", \"Rate\": 100.0}, {\"Max\": 10, \"Min\": 10, \"Name\": \"Flame Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Magma Kaiser\", \"Tech\": \"Blazamut Saddle\", \"Description\": \"Can be ridden. Enhances Fire attacks while mounted.\"}', 'Legends say it was born during a volcanic eruption. A strange group even claims that this continent is laid upon the back of a giant Blazamut.', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Ignis Blast\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a ball of fire straight at an enemy.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Ignis Breath\", \"Type\": \"Fire\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Shoots flames at an enemy, dealing continuous damage.\"}, {\"Name\": \"Ignis Rage\", \"Type\": \"Fire\", \"Level\": 30, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Infuses the surrounding ground with energy,  causing it to explode after a set amount of time.\"}, {\"Name\": \"Fire Ball\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Creates a giant ball of flame and hurls it at an enemy. The ball explodes over a wide area upon impa