(79, '096B', '/public/images/pals/T_KingBahamut_Dragon_icon_normal.png', 'Blazamut Ryu', 'https://palworld.fandom.com/wiki/Blazamut_Ryu', 'https://static.wikia.nocookie.net/palworld/images/d/d9/Blazamut_Ryu.png', '[{\"Name\": \"Dragon\", \"Image\": \"/public/images/elements/T_Icon_element_s_06.png\"}, {\"Name\": \"Fire\", \"Image\": \"/public/images/elements/T_Icon_element_s_01.png\"}]', '[{\"Type\": \"Kindling\", \"Image\": \"/public/images/suitability/T_icon_palwork_00.png\", \"Level\": 4}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 4}]', '[{\"Max\": 10, \"Min\": 10, \"Name\": \"Coal\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Medium Pal Soul\", \"Rate\": 5.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Precious Claw\", \"Rate\": 30.0}]', '{\"Name\": \"Dragon Kaiser\", \"Tech\": \"Blazamut Ryu Saddle\", \"Description\": \"Can be ridden. Enhances Dragon attacks while mounted.\"}', 'Long ago, it emerged from the depths of the earth. With relentless, raging flames showing no mercy, it burned the entire island until nothing remained. It was known as the Eternal Flame.', '[{\"Name\": \"Dragon Burst\", \"Type\": \"Dragon\", \"Level\": 1, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges draconic energy, damaging those around it.\"}, {\"Name\": \"Ignis Breath\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Shoots flames at an enemy, dealing continuous damage.\"}, {\"Name\": \"Flame Wall\", \"Type\": \"Fire\", \"Level\": 15, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a wall of flames at the enemy\'s location. The wall of flames will remain for a while, and deal damage to the enemies it touches.\"}, {\"Name\": \"Comet Strike\", \"Type\": \"Dragon\", \"Level\": 22, \"Power\": 110, \"Cooldown\": 35, \"Description\": \"Drops a meteorite straight down, generating a shock wave around the impact area.\"}, {\"Name\": \"Beam Slicer\", \"Type\": \"Dragon\", \"Level\": 30, \"Power\": 130, \"Cooldown\": 45, \"Description\": \"Mows down the frontal area with a beam imbued with dragon power. The area touched by the beam will also explode after a few moments.\"}, {\"Name\": \"Brawn Impact\", \"Type\": \"Fire\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 38, \"Description\": \"Blazamut\'s exclusive skill. Raises and inflates its arms, then slams them together,  causing a massive explosion in the surrounding area.\"}, {\"Name\": \"Magna Crush\", \"Type\": \"Dragon\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 42, \"Description\": \"Blazamut Ryu\'s exclusive skill. After a big jump, moves at high speed in the air, gathering strength to unleash a powerful punch.\"}]', '{\"HP\": 105, \"Food\": 9, \"Speed\": {\"Run\": 700, \"Ride\": 900, \"Walk\": 400}, \"Attack\": {\"Melee\": 150, \"Ranged\": 130}, \"Defense\": 125, \"Stamina\": 100, \"Support\": 50, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 500, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'KingBahamut Dragon', 'FourLegged', 10, 10520, 'XL', '{\"day\": null, \"night\": null}', '{\"Rank\": 9, \"Order\": 79, \"MaleProbability\": 50}', 'Warlike', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(80, '035', '/public/images/pals/T_BerryGoat_icon_normal.png', 'Caprity', 'https://palworld.fandom.com/wiki/Caprity', 'https://static.wikia.nocookie.net/palworld/images/a/a7/Caprity_menu.png/', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 2}, {\"Type\": \"Farming\", \"Image\": \"/public/images/suitability/T_icon_palwork_12.png\", \"Level\": 1}]', '[{\"Max\": 2, \"Min\": 2, \"Name\": \"Caprity Meat\", \"Rate\": 100.0}, {\"Max\": 4, \"Min\": 2, \"Name\": \"Red Berries\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Horn\", \"Rate\": 100.0}]', '{\"Name\": \"Berry Picker\", \"Tech\": null, \"Description\": \"Sometimes drops Red Berries from its back when assigned to Ranch.\"}', 'The shrub on this Pal\'s back produces berries as long as it is properly fed. It offers these berries to potential mates, and if the flavor is to their liking, romance blossoms.', '[{\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 30, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Spine Vine\", \"Type\": \"Leaf\", \"Level\": 40, \"Power\": 95, \"Cooldown\": 25, \"Description\": \"Generates s