(112, '019', '/public/images/pals/T_DreamDemon_icon_normal.png', 'Daedream', 'https://palworld.fandom.com/wiki/Daedream', 'https://static.wikia.nocookie.net/palworld/images/e/e6/Daedream_menu.png/', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 1}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Venom Gland\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Small Pal Soul\", \"Rate\": 1.0}]', '{\"Name\": \"Dream Chaser\", \"Tech\": \"Daedream\'s Necklace\", \"Description\": \"While in team, appears near the player. Follows up player attacks with magic bullets.\"}', 'It puts those it is interested in to sleep and shows them an endless stream of happy dreams. Those who fall under its spell are never to wake until death takes them.', '[{\"Name\": \"Dark Ball\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Unleashes a sphere of darkness  that slowly tracks down an enemy.\"}, {\"Name\": \"Poison Blast\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls poison sludge at an enemy.\"}, {\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Crystal Breath\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Enshrouds an enemy in a frigid blast of air, dealing continuous damage.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\