(127, '021', '/public/images/pals/T_NightFox_icon_normal.png', 'Nox', 'https://palworld.fandom.com/wiki/Nox', 'https://static.wikia.nocookie.net/palworld/images/5/55/Nox_menu.png/', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 1}]', '[{\"Max\": 1, \"Min\": 1, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Small Pal Soul\", \"Rate\": 40.0}]', '{\"Name\": \"Kuudere\", \"Tech\": null, \"Description\": \"When fighting together, applies Dark damage to the player\'s attacks.\"}', 'If you find Nox hair in your bedding, you should leave it where it lays and leave immediately. Picking it up is a one-way-ticket to a never ending night.', '[{\"Name\": \"Air Cannon\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 25, \"Cooldown\": 2, \"Description\": \"Quickly fires a burst of highly pressurized air.\"}, {\"Name\": \"Dark Ball\", \"Type\": \"Dark\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Unleashes a sphere of darkness  that slowly tracks down an enemy.\"}, {\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 22, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 30, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 40, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Dark Laser\", \"Type\": \"Dark\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges dark energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 75, \"Food\": 2, \"Speed\": {\"Run\": 300, \"Ride\": 500, \"Walk\": 60}, \"Attack\": {\"Melee\": 70, \"Ranged\": 85}, \"Defense\": 70, \"Stamina\": 100, \"Support\": 140, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 164, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'NightFox', 'FourLegged', 6, 1480, 'XS', '{\"day\": null, \"night\": \"/public/images/maps/NightFox_night.png\"}', '{\"Rank\": 1180, \"Order\": 127, \"MaleProbability\": 50}', 'Escape to Battle', 1, 0, 1, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
