(139, '109', '/public/images/pals/T_BlackCentaur_icon_normal.png', 'Necromus', 'https://palworld.fandom.com/wiki/Necromus', 'https://static.wikia.nocookie.net/palworld/images/1/13/Necromus_menu.png/', '[{\"Name\": \"Dark\", \"Image\": \"/public/images/elements/T_Icon_element_s_05.png\"}]', '[{\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 2}]', '[{\"Max\": 10, \"Min\": 10, \"Name\": \"Pal Metal Ingot\", \"Rate\": 100.0}, {\"Max\": 1, \"Min\": 1, \"Name\": \"Large Pal Soul\", \"Rate\": 100.0}]', '{\"Name\": \"Dark Knight of the Abyss\", \"Tech\": \"Necromus Saddle\", \"Description\": \"Can be ridden. Can double jump while mounted.\"}', 'Once one with Paladius.  Its darkened form is the embodiment of negative emotions.  However, a glimmer of compassion can still be seen deep within its eyes.', '[{\"Name\": \"Shadow Burst\", \"Type\": \"Dark\", \"Level\": 1, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Quickly discharges dark energy, damaging those around it.\"}, {\"Name\": \"Spirit Fire\", \"Type\": \"Fire\", \"Level\": 7, \"Power\": 45, \"Cooldown\": 7, \"Description\": \"Shoots fireballs towards an enemy. The fireballs explode after a short distance, generating smaller fireballs that spread forward.\"}, {\"Name\": \"Spirit Flame\", \"Type\": \"Dark\", \"Level\": 15, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Fires three balls of malice that relentlessly pursue an enemy.\"}, {\"Name\": \"Nightmare Ball\", \"Type\": \"Dark\", \"Level\": 22, \"Power\": 100, \"Cooldown\": 30, \"Description\": \"Creates a giant ball of darkness and hurls it at an enemy.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}, {\"Name\": \"Twin Spears\", \"Type\": \"Dark\", \"Level\": 40, \"Power\": 120, \"Co