(140, '087', '/public/images/pals/T_FlowerDoll_icon_normal.png', 'Petallia', 'https://palworld.fandom.com/wiki/Petallia', 'https://static.wikia.nocookie.net/palworld/images/2/28/Petallia_menu.png/', '[{\"Name\": \"Grass\", \"Image\": \"/public/images/elements/T_Icon_element_s_04.png\"}]', '[{\"Type\": \"Planting\", \"Image\": \"/public/images/suitability/T_icon_palwork_02.png\", \"Level\": 3}, {\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 2}, {\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}, {\"Type\": \"Medicine Production\", \"Image\": \"/public/images/suitability/T_icon_palwork_08.png\", \"Level\": 2}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 1}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Beautiful Flower\", \"Rate\": 100.0}]', '{\"Name\": \"Blessing of the Flower Spirit\", \"Tech\": null, \"Description\": \"When activated, uses medicinal flowers to restore the player\'s Health.\"}', 'A Pal that transforms into a massive plant when at the end of its life. Once every ten years, a beautiful flower blooms and a new Petallia is born.', '[{\"Name\": \"Wind Cutter\", \"Type\": \"Leaf\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Fires a high speed blade of wind that flies straight at an enemy.\"}, {\"Name\": \"Aqua Gun\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls a ball of water straight at an enemy.\"}, {\"Name\": \"Seed Machine Gun\", \"Type\": \"Leaf\", \"Level\": 15, \"Power\": 50, \"Cooldown\": 9, \"Description\": \"Fires a volley of hard seeds at enemies in front of it.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 22, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Grass Tornado\", \"Type\": \"Leaf\", \"Level\": 30, \"Power\": 80,