(141, '052', '/public/images/pals/T_NaughtyCat_icon_normal.png', 'Grintale', 'https://palworld.fandom.com/wiki/Grintale', 'https://static.wikia.nocookie.net/palworld/images/c/c3/Grintale_menu.png/', '[{\"Name\": \"Neutral\", \"Image\": \"/public/images/elements/T_Icon_element_s_00.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 2}]', '[{\"Max\": 3, \"Min\": 1, \"Name\": \"High Quality Pal Oil\", \"Rate\": 100.0}]', '{\"Name\": \"Plump Body\", \"Tech\": \"Grintale Saddle\", \"Description\": \"Can be ridden. Enhances Neutral attacks while mounted.\"}', 'Grintale\'s eyes light up the moment anyone enters its territory. This is no figure of speech—its eyes literally light up.', '[{\"Name\": \"Bog Blast\", \"Type\": \"Earth\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Hurls sticky mud at an enemy.\"}, {\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 7, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Cat Press\", \"Type\": \"Neutral\", \"Level\": 15, \"Power\": 60, \"Cooldown\": 9, \"Description\": \"Grintale\'s exclusive skill. Grins menacingly before leaping into the air and smashing foes with its body.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Power Bomb\", \"Type\": \"Neutral\", \"Level\": 40, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Charges a massive amount of energy before firing a large destructive ball.\"}, {\"Name\": \"Pal Blast\", \"Type\": \"Neutral\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges destructive energy before firing a high-powered beam forward across a wide area.