(176, '083B', '/public/images/pals/T_WhiteTiger_Ground_icon_normal.png', 'Cryolinx Terra', 'None', 'None', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Handiwork\", \"Image\": \"/public/images/suitability/T_icon_palwork_04.png\", \"Level\": 1}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 3}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Ore\", \"Rate\": 100.0}]', '{\"Name\": \"Electro Hunter\", \"Tech\": null, \"Description\": \"While fighting together, Electric Pals drop more items when defeated.\"}', 'It can easily carry many items with its large hands.  However, its short legs slow its pace,  often leaving it overtaken by nightfall.', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Sand Tornado\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Generates two sand tornadoes on either side before launching them at an enemy.\"}, {\"Name\": \"Stone Claw\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 95, \"Cooldown\": 17, \"Description\": \"Cryolinx Terra\'s exclusive skill. First, it strikes with its claws, followed by a second slash, and culminates with a powerful slash using its entire body. When swinging the claws, rocks are launched forward in a fan shape.\"}, {\"Nam