(177, '093B', '/public/images/pals/T_FengyunDeeper_Electric_icon_norma.png', 'Fenglope Lux', 'None', 'None', '[{\"Name\": \"Electric\", \"Image\": \"/public/images/elements/T_Icon_element_s_03.png\"}]', '[{\"Type\": \"Generating Electricity\", \"Image\": \"/public/images/suitability/T_icon_palwork_03.png\", \"Level\": 2}, {\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 2}]', '[{\"Max\": 3, \"Min\": 3, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 2, \"Name\": \"Horn\", \"Rate\": 100.0}, {\"Max\": 2, \"Min\": 1, \"Name\": \"Electric Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Stormcloud\", \"Tech\": \"Fenglope Lux Saddle\", \"Description\": \"Can be ridden. Can double jump while mounted. While fighting together,  Water Pals drop more items when defeated.\"}', 'In ages past, it was believed that  drawing a picture of Fenglope Lux would result in being struck down by lightning.  As time passes, artworks depicting Fenglope Lux became revered as  charms to ward off lightning, making them a common presence.', '[{\"Name\": \"Shockwave\", \"Type\": \"Electricity\", \"Level\": 1, \"Power\": 40, \"Cooldown\": 4, \"Description\": \"Quickly discharges electricity, shocking those around it.\"}, {\"Name\": \"Lightning Streak\", \"Type\": \"Electricity\", \"Level\": 7, \"Power\": 75, \"Cooldown\": 16, \"Description\": \"Generates a lightning bolt that moves forward in a line.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Thunder Tempest\", \"Type\": \"Electricity\", \"Level\": 22, \"Power\": 90, \"Cooldown\": 15, \"Description\": \"Charges forward while manipulating the atmosphere  and enveloping itself in thunderclouds.\"}, {\"Name\": \"Thunder Rain\", \"Type\": \"Electricity\", \"Level\": 30, \"Power\": 135, \"Cooldown\": 45, \"Description\": \"Calls lightning that strikes an enemy after a set amount of time has passed.\"}, {\"Name\": \"Lightning Bolt\", \"Type\": \"Electricity\", \"Level\": 40, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges electric energy before blasting enemies with a powerful shock.\"}, {\"Name\": \"Thunderstorm\", \"Type\": \"Electricity\", \"Level\": 50, \"Power\": 160, \"Cooldown\": 60, \"Description\": \"Generates a huge tornado of lightning that moves slowly towards the enemy.\"}]', '{\"HP\": 110, \"Food\": 6, \"Speed\": {\"Run\": 750, \"Ride\": 1050, \"Walk\": 100}, \"Attack\": {\"Melee\": 110, \"Ranged\": 115}, \"Defense\": 90, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 417, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'FengyunDeeper Electric', 'FourLegged', 3, 2720, 'S', '{\"day\": null, \"night\": null}', '{\"Rank\": 835, \"Order\": 177, \"MaleProbability\": 50}', 'NotInterested', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}');
