(178, '105B', '/public/images/pals/T_Horus_Water_icon_normal.png', 'Faleris Aqua', 'https://palworld.fandom.com/wiki/Faleris_Aqua', 'https://static.wikia.nocookie.net/palworld/images/2/22/Faleris_Aqua.png', '[{\"Name\": \"Water\", \"Image\": \"/public/images/elements/T_Icon_element_s_02.png\"}]', '[{\"Type\": \"Watering\", \"Image\": \"/public/images/suitability/T_icon_palwork_01.png\", \"Level\": 4}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 3}]', '[{\"Max\": 4, \"Min\": 2, \"Name\": \"Pal Fluids\", \"Rate\": 100.0}]', '{\"Name\": \"Tidal Predator\", \"Tech\": \"Faleris Aqua Saddle\", \"Description\": \"Can be ridden as a flying mount. While fighting together, Fire Pals drop more items when defeated.\"}', 'When it finds its prey, it unleashes a mighty torrent, sweeping the entire area. More often than not, the prey gets swept away in the chaos,  leaving one to wonder whether this truly counts as hunting.', '[{\"Name\": \"Hydro Jet\", \"Type\": \"Water\", \"Level\": 1, \"Power\": 30, \"Cooldown\": 2, \"Description\": \"Hurls a high speed ball of water at an enemy.\"}, {\"Name\": \"Bubble Blast\", \"Type\": \"Water\", \"Level\": 7, \"Power\": 65, \"Cooldown\": 13, \"Description\": \"Fires numerous bubbles that slowly pursue an enemy.\"}, {\"Name\": \"Acid Rain\", \"Type\": \"Water\", \"Level\": 15, \"Power\": 80, \"Cooldown\": 18, \"Description\": \"Creates acidic clouds that pour down acid rain on enemies.\"}, {\"Name\": \"Splash\", \"Type\": \"Water\", \"Level\": 22, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Generates a column of water that travels in a straight line.\"}, {\"Name\": \"Curtain Splash\", \"Type\": \"Water\", \"Level\": 30, \"Power\": 120, \"Cooldown\": 40, \"Description\": \"Continously creates walls made from water columns at the enemy\'s location.\"}, {\"Name\": \"Phoenix Tide\", \"Type\": \"Water\", \"Level\": 40, \"Power\": 135, \"Cooldown\": 28, \"Description\": \"Faleris Aqua\'s exclusive skill. After summoning a massive tornado, it envelops its body in water and charges forward.\"}, {\"Name\": \"Hydro Laser\", \"Type\": \"Water\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Shoots pressurized water at extreme velocities, sweeping over a wide area in front of it.\"}]', '{\"HP\": 100, \"Food\": 8, \"Speed\": {\"Run\": 1000, \"Ride\": 1400, \"Walk\": 200}, \"Attack\": {\"Melee\": 100, \"Ranged\": 110}, \"Defense\": 110, \"Stamina\": 230, \"Support\": 90, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 1.0, \"Transportspeed\": 500, \"EnemyInflictDamageRate\": 1.0, \"EnemyReceiveDamageRate\": 1.0}', 'Horus Water', 'Bird', 9, 7260, 'L', '{\"day\": \"/public/images/maps/Horus_Water_day.png\", \"night\": \"/public/images/maps/Horus_Water_night.png\"}', '{\"Rank\": 245, \"Order\": 178, \"MaleProbability\": 50}', 'Warlike', 0, 0, 0, 0, 0, 0, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
(179, '137', '/public/images/pals/T_SnowTigerBeastman_icon_normal.png', 'Bastigor', 'https://palworld.fandom.com/wiki/Bastigor', 'https://static.wikia.nocookie.net/palworld/images/4/4f/Bastigor.png', '[{\"Name\": \"Ice\", \"Image\": \"/public/images/elements/T_Icon_element_s_08.png\"}]', '[{\"Type\": \"Lumbering\", \"Image\": \"/public/images/suitability/T_icon_palwork_06.png\", \"Level\": 3}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 3}, {\"Type\": \"Cooling\", \"Image\": \"/public/images/suitability/T_icon_palwork_10.png\", \"Level\": 4}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Leather\", \"Rate\": 100.0}, {\"Max\": 5, \"Min\": 2, \"Name\": \"Ice Organ\", \"Rate\": 100.0}]', '{\"Name\": \"Blizzard Crash\", \"Tech\": \"Bastigor\'s Hammer\", \"Description\": \"Can be ridden. While mounted, delivers crushing blows with a Ice-forged hammer.\"}', 'The sight of anything round gives it an uncontrollable urge to punch it. For <characterName id=|SnowTigerBeastMan|/> the toughest challenge, after simply living, is making a snowman.', '[{\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 1, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Iceberg\", \"Type\": \"Ice\", \"Level\": 7, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Summons a sharp ice lance under an enemy.\"}, {\"Name\": \"Crystal Breath\", \"Type\": \"Ice\", \"Level\": 15, \"Power\": 90, \"Cooldown\": 22, \"Description\": \"Enshrouds an enemy in a frigid blast of air, dealing continuous damage.\"}, {\"Name\": \"Frost Talon\", \"Type\": \"Ice\", \"Level\": 22, \"Power\": 95, \"Cooldown\": 17, \"Description\": \"Bastigor\'s exclusive skill. Stomps the ground, creating a fissure of ice ahead.  Then, rapidly closes the distance and slashes with the right hand.\"}, {\"Name\": \"Rockburst\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 130, \"Cooldown\": 35, \"Description\": \"Caus