(180, '120', '/public/images/pals/T_WingGolem_icon_normal.png', 'Knocklem', 'https://palworld.fandom.com/wiki/Knocklem', 'https://static.wikia.nocookie.net/palworld/images/3/3c/Knocklem.png', '[{\"Name\": \"Ground\", \"Image\": \"/public/images/elements/T_Icon_element_s_07.png\"}]', '[{\"Type\": \"Gathering\", \"Image\": \"/public/images/suitability/T_icon_palwork_05.png\", \"Level\": 3}, {\"Type\": \"Mining\", \"Image\": \"/public/images/suitability/T_icon_palwork_07.png\", \"Level\": 4}, {\"Type\": \"Transporting\", \"Image\": \"/public/images/suitability/T_icon_palwork_11.png\", \"Level\": 4}]', '[{\"Max\": 3, \"Min\": 2, \"Name\": \"Ore\", \"Rate\": 100.0}]', '{\"Name\": \"Steel Guardian Mode\", \"Tech\": \"en_text Saddle\", \"Description\": \"When activated, a steel resolve increases Knocklem\'s attack and defense for a limited time.\"}', 'Can be disassembled into 215 parts, and even if the parts are scattered, it will reassemble itself and start moving again.  If parts from different individuals are mixed it will malfunction due to mistaken identity. ', '[{\"Name\": \"Power Shot\", \"Type\": \"Neutral\", \"Level\": 1, \"Power\": 35, \"Cooldown\": 4, \"Description\": \"Charges energy into a focused blast.\"}, {\"Name\": \"Stone Blast\", \"Type\": \"Earth\", \"Level\": 7, \"Power\": 55, \"Cooldown\": 10, \"Description\": \"Fires a barrage of stones forward.\"}, {\"Name\": \"Stone Cannon\", \"Type\": \"Earth\", \"Level\": 15, \"Power\": 70, \"Cooldown\": 15, \"Description\": \"Digs up a boulder and hurls it at an enemy.\"}, {\"Name\": \"Rockburst\", \"Type\": \"Earth\", \"Level\": 22, \"Power\": 130, \"Cooldown\": 35, \"Description\": \"Causes the ground to shake before hurling a massive stone mass at its surroundings.\"}, {\"Name\": \"Rock Lance\", \"Type\": \"Earth\", \"Level\": 30, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Generates a sharp rock spear under an enemy.\"}, {\"Name\": \"Ground Cutter\", \"Type\": \"Earth\", \"Level\": 40, \"Power\": 14