aser\", \"Type\": \"Dark\", \"Level\": 50, \"Power\": 150, \"Cooldown\": 55, \"Description\": \"Charges dark energy before blasting enemies with a powerful beam.\"}]', '{\"HP\": 90, \"Food\": 7, \"Speed\": {\"Run\": 550, \"Ride\": 700, \"Walk\": 245}, \"Attack\": {\"Melee\": 100, \"Ranged\": 125}, \"Defense\": 85, \"Stamina\": 100, \"Support\": 100, \"CraftSpeed\": 100, \"EnemyMaxHPRate\": 10.0, \"Transportspeed\": 400, \"EnemyInflictDamageRate\": 2.0, \"EnemyReceiveDamageRate\": 1.0}', 'DarkAlien Oilrig', 'Humanoid', 7, 6750, 'S', '{\"day\": null, \"night\": null}', '{\"Rank\": 9999, \"Order\": 181, \"MaleProbability\": 50}', 'Warlike', 1, 1, 0, 0, 0, 1, '{\"Name\": null, \"Image\": null, \"Description\": null}'),
