(3, 'Overfull', 1, 0, 0, 100, 'Insatiable. Hunger decreases rapidly. Give medicine for a quick recovery.', 20),
(4, 'Ulcer', 2, -20, -10, 0, 'Stomach is in pain. Work speed is temporarily decreased. Give medicine for a quick recovery.', 15),
(5, 'Fracture', 2, -10, -20, 0, 'Bone is broken and in extreme pain. Movement speed is temporarily decreased. Give medicine for a quick recovery.', 15),
(6, 'Weakened', 3, -20, -30, 0, 'Body is very weakened. Both work and movement speed are significantly reduced while in this state. Give medicine for a quick recovery.', 10),
(7, 'Depressed', 3, -30, -20, 0, 'Mental state is very fragile. Both work and movement speed are significantly reduced while in this state. Give medicine for a quick recovery.', 10),
(8, 'Troublemaker', 4, -50, -50, 0, 'Behavior is extremely abnormal. Both work and movement speed are drastically reduced while in this state. Mental swipe is necessary to put the renegade back in line.', 3);
INSERT INTO `techtree` (`ID`, `Name`, `UnlockBuildObjects`, `UnlockItemRecipes`, `Description`, `Image`, `RequireTechnology`, `IsBossTechnology`, `LevelCap`, `Cost`) VALUES
(1, 'Primitive Workbench', '[\"Primitive Workbench\"]', 'null', 'Primitive Workbench for producing simple items. Pals with Handiwork suitability help speed up production.', '/public/images/build/T_icon_buildObject_WorkBench.png', NULL, 0, 1, 1),
(2, 'Stone Axe', 'null', '[\"Stone Axe\"]', 'An axe for cutting wood. Made from stone, it\'s not very sharp.', '/public/images/weapon/T_itemicon_Weapon_Axe_Tier_00.png', NULL, 0, 1, 1),
(3, 'Stone Pickaxe', 'null', '[\"Stone Pickaxe\"]', 'A pickaxe used for mining. Made from stone, the efficiency is questionable.', '/public/images/weapon/T_itemicon_Weapon_Pickaxe_Tier_00.png', NULL, 0, 1, 1),
(4, 'Hand-Held Torch', 'null', '[\"Hand-Held Torch\"]', 'Lights up dark areas and keeps you warm. Can also be used for close range combat in a pinch. Crafts Hand-Held Torch atPrimitive Workbench.', '/public/images/build/T_icon_buildObject_TorchStand.png', NULL, 0, 1, 1),
(5, 'Wooden Club', 'null', '[\"Wooden Club\"]', 'A Wooden Club for close range combat. Can beat a small Pal to a pulp if need be.', '/public/images/weapon/T_itemicon_Weapon_Bat.png', NULL, 0, 1, 1),
(6, 'Pal Dressing Facility', '[\"Pal Dressing Facility\"]', 'null', 'Pal Dressing Facility. Give your Pals a new look! Skins obtained inside and outside the game can be applied here!', '/public/images/build/T_icon_buildObject_SkinChange.png', NULL, 0, 1, 1),
(7, 'Palbox', '[\"Palbox\"]', 'null', 'Facility for storing captured Pals. Pals inside gradually recover Health. The area around this structure will become your base.', '/public/images/build/T_icon_buildObject_PalBoxV2.png', NULL, 0, 2, 1),
(8, 'Pal Sphere', 'null', '[\"Pal Sphere\"]', 'An item that captures Pals when thrown. This basic model is only effective on low level Pals.', '/public/images/other/T_itemicon_PalSphere.png', NULL, 0, 2, 1),
(9, 'Campfire', '[\"Campfire\"]', 'null', 'Used to make simple food or provide meager warmth and light.', '/public/images/build/T_icon_buildObject_CampFire.png', NULL, 0, 2, 1),
(10, 'Wooden Chest', '[\"Wooden Chest\"]', 'null', 'Used to store items. Place at a base and Pals with Transporting suitability will automatically carry items to it.', '/public/images/build/T_icon_buildObject_ItemChest.png', NULL, 0, 2, 1),
(11, 'Repair Bench', '[\"Repair Bench\"]', 'null', 'Repairs damaged weapons and tools.', '/public/images/build/T_icon_buildObject_RepairBench.png', NULL, 0, 2, 1),
(12, 'Wooden Structure Set', '[\"Wooden Foundation\", \"Wooden Wall\", \"Wooden Roof\", \"Wooden Stairs\", \"Wooden Wall and Window\", \"Wooden Triangular Wall\", \"Wooden Slanted Roof\", \"Wooden Door\", \"Wooden Pillar\"]', 'null', 'Set for building bases using wood. Allows building of wooden foundations, walls, ceilings, stairs and other things necessary for shelters.', '/public/images/build/T_icon_buildObject_Wood_Foundation.png', NULL, 0, 2, 2),
(13, 'Old Bow', 'null', '[\"Old Bow\"]', 'Primitive long range weapon. Requires Primitive Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_WeakerBow.png', NULL, 0, 3, 1),
(14, 'Arrow', 'null', '[\"Arrow\"]', 'Used with Old Bow. Requires Primitive Workbench to craft.', '/public/images/ammo/T_itemicon_Ammo_Arrow.png', NULL, 0, 3, 1),
(15, 'Shoddy Bed', '[\"Shoddy Bed\"]', 'null', 'Human bed. Sleeping restores Health. Sleep at night and time will pass until morning. Cannot sleep unless built under a roof.', '/public/images/build/T_icon_buildObject_PlayerBed_02.png', NULL, 0, 3, 1),
(16, 'Straw Pal Bed', '[\"Straw Pal Bed\"]', 'null', 'Pals at base recover SAN when sleeping in beds at night. Without a bed, Pals cannot sleep soundly, and no SAN is recovered.', '/public/images/build/T_icon_buildObject_MedicalPalBed_02.png', NULL, 0, 3, 2),
(17, 'Repair Kit', 'null', '[\"Repair Kit\"]', 'Tools for repairing structures. Use it on destroyed structures to repair them.', '/public/images/tex/Tex_tools_10.png', NULL, 0, 3, 1),
(18, 'Cloth', 'null', '[\"Cloth\"]', 'Cloth woven from Wool. Required to create armor.', '/public/images/material/T_itemicon_Material_Cloth.png', NULL, 0, 3, 1),
(19, 'Common Shield', 'null', '[\"Common Shield\"]', 'Strange shield made with Paldium technology. It automatically repair itself after not taking damage for a while.', '/public/images/armor/T_itemicon_Armor_Shield_01.png', NULL, 0, 4, 2),
(20, 'Stone Spear', 'null', '[\"Stone Spear\"]', 'Useful for close-range combat. Its length allows you to stand further away when attacking.', '/public/images/weapon/T_itemicon_Weapon_Spear_Tier_00.png', NULL, 0, 4, 2),
(21, 'Cloth Outfit', 'null', '[\"Cloth Outfit\"]', 'Protects against cold nights. Requires Primitive Workbench to craft.', '/public/images/armor/T_itemicon_Armor_ClothArmor.png', NULL, 0, 4, 2),
(22, 'Feed Box', '[\"Feed Box\"]', 'null', 'Place food here, and Pals at the base will eat from it.', '/public/images/build/T_icon_buildObject_PalFoodBox.png', NULL, 0, 4, 2),
(23, 'Alarm Bell', '[\"Alarm Bell\"]', 'null', 'Bell that sets the alert status for Pals on base. Change Pal behavior to either attack invading enemies or focus entirely on work whenever you like.', '/public/images/build/T_icon_buildObject_BaseCampBattleDirector.png', NULL, 0, 4, 1),
(24, 'Hanging Trap', '[\"Hanging Trap\"]', 'null', 'Catches Pals that pass through. Only effective on small Pals and humans.', '/public/images/build/T_icon_buildObject_Trap_Noose.png', NULL, 0, 4, 1),
(25, 'Berry Plantation', '[\"Berry Plantation\"]', 'null', 'Can produce berries at a base. Requires Pal with Planting, Watering, and Gathering suitabilities.', '/public/images/build/T_icon_buildObject_FarmBlockV2_Berries.png', NULL, 0, 5, 2),
(26, 'Ranch', '[\"Ranch\"]', 'null', 'Farm for raising sheep-and fowl-like Pals. Assign a Pal with the appropriate traits to a farm to automatically produce items.', '/public/images/build/T_icon_buildObject_MonsterFarm.png', NULL, 0, 5, 2),
(27, 'Normal Parachute', 'null', '[\"Normal Parachute\"]', 'A glider for soaring through the air. Cheaply made, it isn\'t very fast.', '/public/images/glider/T_itemicon_Glider_Glider_Old.png', NULL, 0, 5, 2),
(28, 'Fire Bow', 'null', '[\"Fire Bow\"]', 'A bow that deals Fire damage. Burns Pals with fire arrows, making them easier to capture. Requires Fire Arrow.', '/public/images/weapon/T_itemicon_Weapon_Bow_Fire.png', NULL, 0, 5, 2),
(29, 'Fire Arrow', 'null', '[\"Fire Arrow\"]', 'Arrows for shooting with Fire Bow and Fire Arrow Crossbow. Deals Fire damage. Requires Primitive Workbench to craft.', '/public/images/ammo/T_itemicon_Ammo_Arrow_Fire.png', NULL, 0, 5, 1),
(30, 'Pal Gear Workbench', '[\"Pal Gear Workbench\"]', 'null', 'Produces items that allow Pals to use Partner Skills.', '/public/images/build/T_icon_buildObject_WorkBench_SkillUnlock.png', NULL, 0, 6, 2),
(31, 'Statue of Power', '[\"Statue of Power\"]', 'null', 'Make offerings to enhance the stats of the Player and their Pals.', '/public/images/build/T_icon_buildObject_BuildableGoddessStatue.png', NULL, 0, 6, 2),
(32, 'Mounted Torch', '[\"Mounted Torch\"]', 'null', 'Place it at a base to light the surrounding area.', '/public/images/build/T_icon_buildObject_TorchStand.png', NULL, 0, 6, 2),
(33, 'Rushoar Saddle', 'null', '[\"Rushoar Saddle\"]', 'Saddle for safely riding Rushoar.', '/public/images/pals/T_Boar_icon_normal.png', NULL, 0, 6, 1),
(34, 'Foxparks\'s Harness', 'null', '[\"Foxparks\'s Harness\"]', 'Harness for holding Foxparks. Activate its Partner Skill to hold Foxparks and attack using it as a flamethrower.', '/public/images/pals/T_Kitsunebi_icon_normal.png', NULL, 0, 6, 1),
(35, 'Logging Site', '[\"Logging Site\"]', 'null', 'Can produce wood at a base. Requires Pal with Lumbering trait.', '/public/images/build/T_icon_buildObject_StationDeforest2.png', NULL, 0, 7, 2),
(36, 'Stone Pit', '[\"Stone Pit\"]', 'null', 'Can produce stone at a base. Requires Pal with Mining trait.', '/public/images/build/T_icon_buildObject_StonePit.png', NULL, 0, 7, 2),
(37, 'Sign', '[\"Sign\"]', 'null', 'Can be written on.', '/public/images/build/T_icon_buildObject_Signboard.png', NULL, 0, 7, 1),
(38, 'Bat', 'null', '[\"Bat\"]', 'Baseball bat for close-range combat. Might be tough to get a home run with a Pal.', '/public/images/weapon/T_itemicon_Weapon_Spear_Bat2.png', NULL, 0, 7, 1),
(39, 'Melpaca Saddle', 'null', '[\"Melpaca Saddle\"]', 'Saddle for safely riding Melpaca.', '/public/images/pals/T_Alpaca_icon_normal.png', NULL, 0, 7, 1),
(40, 'Celaray\'s Gloves', 'null', '[\"Celaray\'s Gloves\"]', 'Gloves for gently holding on to Celaray\'s fins. If Celaray is in your team, it can be used as a glider.', '/public/images/pals/T_FlyingManta_icon_normal.png', NULL, 0, 7, 1),
(41, 'Egg Incubator', '[\"Egg Incubator\"]', 'null', 'Place a Pal Egg inside to incubate it.', '/public/images/build/T_icon_buildObject_HatchingPalEgg.png', NULL, 1, 7, 1),
(42, 'Crusher', '[\"Crusher\"]', 'null', 'Facility for breaking down Stone and Wood to exchange them for other materials. Requires Pal with the Watering suitability to spin the water turbine.', '/public/images/build/T_icon_buildObject_Crusher.png', NULL, 0, 8, 2),
(43, 'Poison Bow', 'null', '[\"Poison Bow\"]', 'Frightening bow that poisons its target. Poisoned Pals are easier to capture. Requires Poison Arrow.', '/public/images/weapon/T_itemicon_Weapon_Bow_Poison.png', NULL, 0, 8, 2),
(44, 'Poison Arrow', 'null', '[\"Poison Arrow\"]', 'Arrows for shooting with Poison Bow and Poison Arrow Crossbow. It poisons any target it hits. Requires Primitive Workbench to craft.', '/public/images/ammo/T_itemicon_Ammo_Arrow_Poison.png', NULL, 0, 8, 1),
(45, 'Jolthog\'s Gloves', 'null', '[\"Jolthog\'s Gloves\"]', 'Rubber gloves for handling Jolthog. Activate its Partner Skill to throw Jolthog as a shock grenade.', '/public/images/pals/T_Hedgehog_icon_normal.png', NULL, 0, 8, 1),
(46, 'Daedream\'s Necklace', 'null', '[\"Daedream\'s Necklace\"]', 'Collar for Daedream. If Daedream is in your team, it will stay by your side and attack enemies in tandem.', '/public/images/pals/T_DreamDemon_icon_normal.png', NULL, 0, 8, 2),
(47, 'Tropical Outfit', 'null', '[\"Tropical Outfit\"]', 'Cloth Outfit produced in hot regions. Boasts high heat resistance. Requires Primitive Workbench to craft.', '/public/images/armor/T_itemicon_Armor_ClothArmorHeat.png', NULL, 0, 9, 3),
(48, 'Tundra Outfit', 'null', '[\"Tundra Outfit\"]', 'Cloth Outfit produced in cold regions. Useful for surviving in cold climates. Requires Primitive Workbench to craft.', '/public/images/armor/T_itemicon_Armor_ClothArmorCold.png', NULL, 0, 9, 3),
(49, 'Hot Spring', '[\"Hot Spring\"]', 'null', 'Pals recover SAN while in a Hot Spring.', '/public/images/build/T_icon_buildObject_Spa.png', NULL, 0, 9, 2),
(50, 'Sandbag', '[\"Sandbag\"]', 'null', 'Pals assigned to it will watch for approaching enemies.', '/public/images/build/T_icon_buildObject_DefenseWait.png', NULL, 0, 9, 2),
(51, 'Direhowl\'s Saddled Harness', 'null', '[\"Direhowl\'s Saddled Harness\"]', 'Saddle for safely riding Direhowl.', '/public/images/pals/T_Garm_icon_normal.png', NULL, 0, 9, 1),
(52, 'Killamari\'s Gloves', 'null', '[\"Killamari\'s Gloves\"]', 'Gloves for gently holding on to Killamari\'s legs. If Killamari is in your team, it can be used as a glider.', '/public/images/pals/T_NegativeOctopus_icon_normal.png', NULL, 0, 9, 1),
(53, 'Three Shot Bow', 'null', '[\"Three Shot Bow\", \"Arrow\"]', 'An enhanced bow that allows three arrows to be fired simultaneously. By some strange mechanism, it only consumes a single Arrow when fired.', '/public/images/weapon/T_itemicon_Weapon_Bow.png', NULL, 0, 10, 2),
(54, 'Primitive Furnace', '[\"Primitive Furnace\"]', 'null', 'Uses Ore to produce Ingots.', '/public/images/build/T_icon_buildObject_BlastFurnace.png', NULL, 0, 10, 3),
(55, 'Feathered Hair Band', 'null', '[\"Feathered Hair Band\"]', 'A beautiful feathered headband. Though improbable, it somehow protects its wearer from lethal head injuries. Requires <mapObjectName id=|Workbench|/> to craft.', '/public/images/armor/T_itemicon_Armor_FurHelmet.png', NULL, 0, 10, 2),
(56, 'Ladder', '[\"Ladder\"]', 'null', 'A ladder that allows you to climb to a slightly higher place.', '/public/images/build/T_icon_buildObject_Wooden_Ladder.png', NULL, 0, 10, 1),
(57, 'Bear Trap (Small)', '[\"Bear Trap (Small)\"]', 'null', 'Immobilizes those who step on it. Only effective on small Pals or humans.', '/public/images/build/T_icon_buildObject_Trap_LegHold.png', NULL, 0, 10, 1),
(58, 'Nail', 'null', '[\"Nail\"]', 'Necessary for building various facilities. Can be made with a Primitive Workbench.', '/public/images/material/T_itemicon_Material_MachineParts.png', NULL, 0, 10, 1),
(59, 'Surfent Saddle', 'null', '[\"Surfent Saddle\"]', 'Saddle for safely riding Surfent.', '/public/images/pals/T_Serpent_icon_normal.png', NULL, 0, 10, 1),
(60, 'Small Feed Bag', 'null', '[\"Small Feed Bag\"]', 'Unlocks a food slot in your inventory. Players and Pals automatically consume food when hungry.', '/public/images/essential/T_itemicon_Essential_AutoMealPouch_Tier1.png', NULL, 1, 10, 1),
(61, 'Metal Axe', 'null', '[\"Metal Axe\"]', 'An axe for cutting wood. Made from metal, its sharpness has improved. Requires High Quality Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_Axe_Tier_00.png', NULL, 0, 11, 2),
(62, 'Metal Pickaxe', 'null', '[\"Metal Pickaxe\"]', 'A pickaxe used for mining. Made from metal, its durability and efficiency have improved. Requires High Quality Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_Pickaxe_Tier_00.png', NULL, 0, 11, 2),
(63, 'High Quality Workbench', '[\"High Quality Workbench\"]', 'null', 'Produces faster than Primitive Workbench. Requires Pal with Handiwork trait.', '/public/images/build/T_icon_buildObject_Factory_Hard_01.png', NULL, 0, 11, 3),
(64, 'Heavy Weight Module', 'null', '[\"Heavy Weight Module\"]', 'Equipping it makes the sphere heavier, reducing its range but increasing its capture power.', '/public/images/other/T_itemicon_SphereModule_Heavy.png', NULL, 0, 11, 1),
(65, 'Wooden Gate', '[\"Wooden Gate\"]', 'null', 'Wooden gate large enough for big Pals to pass through.', '/public/images/build/T_icon_buildObject_Wood_Gate.png', NULL, 0, 11, 2),
(66, 'Lifmunk\'s Submachine Gun', 'null', '[\"Lifmunk\'s Submachine Gun\"]', 'Submachine gun made specifically for Lifmunk. Activate its Partner Skill, and Lifmunk will ride on your head and fire at enemies.', '/public/images/pals/T_Carbunclo_icon_normal.png', NULL, 0, 11, 1),
(67, 'Jolthog Cryst\'s Gloves', 'null', '[\"Jolthog Cryst\'s Gloves\"]', 'Rubber gloves for handling Jolthog Cryst. Activate its Partner Skill to throw Jolthog Cryst as an ice grenade.', '/public/images/pals/T_Hedgehog_Ice_icon_normal.png', NULL, 0, 11, 1),
(68, 'Pelt Armor', 'null', '[\"Pelt Armor\"]', 'Armor made from Leather. Its warmth and defense have been improved. Requires High Quality Workbench to craft.', '/public/images/armor/T_itemicon_Armor_FurArmor.png', NULL, 0, 12, 2),
(69, 'Meat Cleaver', 'null', '[\"Meat Cleaver\"]', 'Knife for butchering Pals. When equipped, the Pet command becomes Butcher. Butchered Pals will be gone for good.', '/public/images/weapon/T_itemicon_Weapon_MeatCutterKnife.png', NULL, 0, 12, 2),
(70, 'Medieval Medicine Workbench', '[\"Medieval Medicine Workbench\"]', 'null', 'Can produce simple medicine. Requires Pal with Medicine Production trait.', '/public/images/build/T_icon_buildObject_MedicineFacility_01.png', NULL, 0, 12, 2),
(71, 'Tanzee\'s Assault Rifle', 'null', '[\"Tanzee\'s Assault Rifle\"]', 'Assault rifle made specifically for Tanzee. Activate its Partner Skill, and Tanzee will enter gunner mode and begin shooting at nearby enemies.', '/public/images/pals/T_Monkey_icon_normal.png', NULL, 0, 12, 1),
(72, 'Eikthyrdeer Saddle', 'null', '[\"Eikthyrdeer Saddle\"]', 'Saddle for safely riding Eikthyrdeer.', '/public/images/pals/T_Deer_icon_normal.png', NULL, 0, 12, 2),
(73, 'Grappling Gun', 'null', '[\"Grappling Gun\"]', 'It fires a hook that latches on to distant targets, pulling the user\'s body towards the target. It allows for easy movement between places with varying elevation.', '/public/images/weapon/T_itemicon_Weapon_GrapplingGun.png', NULL, 1, 12, 1),
(74, 'Crossbow', 'null', '[\"Crossbow\"]', 'Fires an Arrow effortlessly. Though it takes time to load, it delivers a powerful shot. Requires High Quality Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_BowGun.png', NULL, 0, 13, 2),
(75, 'Metal Spear', 'null', '[\"Metal Spear\"]', 'Useful for close-range combat. The metal tip give it an increased attack power. Requires High Quality Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_Spear_Tier_00.png', NULL, 0, 13, 2),
(76, 'Human-Powered Generator', '[\"Human-Powered Generator\"]', 'null', 'A facility that converts rotational motion into electrical energy. The efficiency is low, and the Pals working here will experience a decrease in SAN value, but they will gain experience points.', '/public/images/build/T_icon_buildObject_ManualElectricGenerator.png', NULL, 0, 13, 1),
(77, 'Training Dummy', '[\"Training Dummy\"]', 'null', 'Training dummy shaped like a Pengullet.', '/public/images/build/T_icon_buildObject_DamagedScarecrow.png', NULL, 0, 13, 2),
(78, 'Cooler Box', '[\"Cooler Box\"]', 'null', 'Small food vault. Assign an Ice Pal to help prevent food stored inside from spoiling.', '/public/images/build/T_icon_buildObject_CoolerBox.png', NULL, 0, 13, 2),
(79, 'Grintale Saddle', 'null', '[\"Grintale Saddle\"]', 'Saddle for safely riding Grintale.', '/public/images/pals/T_NaughtyCat_icon_normal.png', NULL, 0, 13, 1),
(80, 'Chillet Saddle', 'null', '[\"Chillet Saddle\"]', 'Saddle for safely riding Chillet.', '/public/images/pals/T_WeaselDragon_icon_normal.png', NULL, 0, 13, 2),
(81, 'Mega Sphere', 'null', '[\"Mega Sphere\"]', 'An item that captures Pals when thrown. Its capabilities have been improved, allowing it to catch a wider range of Pals. Requires Sphere Workbench to craft.', '/public/images/palsphere/T_itemicon_PalSphere_Mega.png', NULL, 0, 14, 2),
(82, 'Sphere Workbench', '[\"Sphere Workbench\"]', 'null', 'Produces Spheres for capturing Pals. Requires Pal with Handiwork suitability.', '/public/images/build/T_icon_buildObject_SphereFactory_Black_01.png', NULL, 0, 14, 3),
(83, 'Wall Torch', '[\"Wall Torch\"]', 'null', 'Place it on a wall to light the surrounding area.', '/public/images/build/T_icon_buildObject_TorchHang.png', NULL, 0, 14, 2),
(84, 'Sweepa Saddle', 'null', '[\"Sweepa Saddle\"]', 'Saddle for safely riding Sweepa.', '/public/images/pals/T_MopKing_icon_normal.png', NULL, 0, 14, 1),
(85, 'Univolt Saddle', 'null', '[\"Univolt Saddle\"]', 'Saddle for safely riding Univolt.', '/public/images/pals/T_Kirin_icon_normal.png', NULL, 0, 14, 1),
(86, 'Pal Essence Condenser', '[\"Pal Essence Condenser\"]', 'null', 'Combines several Pals of the same type to create a higher-ranked version.', '/public/images/build/T_icon_buildObject_CharacterRankUp.png', NULL, 1, 14, 2),
(87, 'Fire Arrow Crossbow', 'null', '[\"Fire Arrow Crossbow\"]', 'A Crossbow that deals Fire damage. Requires Fire Arrow. Requires Weapon Workbench to craft.', '/public/images/weapon/T_itemicon_Weapon_BowGun_Fire.png', NULL, 0, 15, 2),
(88, 'Pal Expedition Station', '[\"Pal Expedition Station\"]', 'null', 'A facility that allows Pals to be sent on expeditions to places like dungeons.  The dispatched Pals engage in battles and gather items, bringing back resources to the base.', '/public/images/build/T_icon_buildObject_Expedition.png', NULL, 0, 15, 2),
(89, 'Wheat Plantation', '[\"Wheat Plantation\"]', 'null', 'Use it to grow ingredients for Bread. Requires Pal with Planting, Watering, and Gathering suitabilities.', '/public/images/build/T_icon_buildObject_FarmBlockV2_wheet.png', NULL, 0, 15, 2),
(90, 'Mill', '[\"Mill\"]', 'null', 'Facility for milling Wheat to produce Flour.  Requires Pal with the Watering suitability to spin the water turbine.', '/public/images/build/T_icon_buildObject_FlourMill.png', NULL, 0, 15, 2),
(91, 'Monitoring Stand', '[\"Monitoring Stand\"]', 'null', 'Command your Pals to work on various things inside a base. You can allow or prohibit individual kinds of work.', '/public/images/build/T_icon_buildObject_BaseCampWorkHard.png', NULL, 0, 15, 2),
(92, 'Viewing Cage', '[\"Viewing Cage\"]', 'null', 'Container for observing captured Pals. Pals inside cannot participate in battle or production, but they do not become hungry.', '/public/images/build/T_icon_buildObject_DisplayCharacter.png', NULL, 0, 15, 2),
(93, 'Nitewing Saddle', 'null', '[\"Nitewing Saddle\"]', 'Saddle for safely riding Nitewing.', '/public/images/pals/T_HawkBird_icon_normal.png', NULL, 0, 15, 2),
(94, 'Hip Lantern', 'null', '[\"Hip Lantern\"]', 'A lantern that can be attached to the hip. It lights up automatically at night. Just one is enough to find your way in the dark.', '/public/images/essential/T_itemicon_Essential_Lantern.png', NULL, 1, 15, 2),
(95, 'Mega Shield', 'null', '[\"Mega Shield\"]', 'Strange shield made with Paldium technology. The new model has been improved, enhancing its defense. Can be made at High Quality Workbench.', '/public/images/armor/T_itemicon_Armor_Shield_02.png', NULL, 0, 16, 2),
(96, 'Heat Resistant Pelt Armor', 'null', '[\"Heat Resistant Pelt Armor\"]', 'Pelt Armor produced in hot regions. Boasts high heat resistance. Requires High Quality Workbench to craft.', '/public/images/armor/T_itemicon_Armor_FurArmorHeat.png', NULL, 0, 16, 3),
(97, 'Metal Chest', '[\"Metal Chest\"]', 'null', 'Can be used to store more items. Pals with Transporting suitability will automatically carry items to it.', '/public/images/build/T_icon_buildObject_ItemChest_02.png', NULL, 0, 16, 2),
(98, 'Wooden Defensive Wall', '[\"Wooden Defensive Wall\"]', 'null', 'Massive defensive wall to prevent enemy intrusions. Made from wood, it breaks easily.', '/public/images/build/T_icon_buildObject_DefenseWall_Wood.png', NULL, 0, 16, 1),
(99, 'Arsox Saddle', 'null', '[\"Arsox Saddle\"]', 'Saddle for safely riding Arsox.', '/public/images/pals/T_FlameBuffalo_icon_normal.png', NULL, 0, 16, 1),
(100, 'Lockpicking Tool v1', 'null', '[\"Lockpicking Tool v1\"]', 'No key? No problem! These tools will allow you to try and pry open any treasure chest that would normally require a Copper Key.', '/public/images/essential/T_itemicon_Essential_Unlock_Picking.png', NULL, 1, 16, 1),
