(208, 'Hangyu Cryst\'s Glove', 'null', '[\"Hangyu Cryst\'s Glove\"]', 'Gloves for gently holding on to Hangyu Cryst\'s arms. If Hangyu Cryst is in your team, it can be used as a glider.', '/public/images/pals/T_WindChimes_Ice_icon_normal.png', NULL, 0, 31, 1),
(209, 'Giga Grappling Gun', 'null', '[\"Giga Grappling Gun\"]', 'It fires a hook that latches on to distant targets, pulling the user\'s body towards the target. Using data from prototype versions, its capabilities have been further increased.', '/public/images/weapon/T_itemicon_Weapon_GrapplingGun.png', 'Mega Grappling Gun', 1, 31, 3),
(210, 'Compound Bow', 'null', '[\"Compound Bow\"]', 'A modernized bow.  Capable of firing more powerful arrows.', '/public/images/weapon/T_itemicon_Weapon_CompoundBow.png', NULL, 0, 32, 3),
