(212, 'Weapon Assembly Line', '[\"Weapon Assembly Line\"]', 'null', 'Needs electricity but produces weapons and ammunition at a faster pace. Requires Pal with Handiwork trait.', '/public/images/build/T_icon_buildObject_WeaponFactory_Dirty_02.png', NULL, 0, 32, 3),
(213, 'Carrot Plantation', '[\"Carrot Plantation\"]', 'null', 'A farm where you can grow Carrot. It takes time to harvest, but increases the variety of meals you can prepare. Requires a few Pals to plant seeds, water, and harvest the crops.', '/public/images/food/T_itemicon_Food_Carrot.png', NULL, 0, 32, 2),
(214, 'Witch Cauldron', '[\"Witch Cauldron\"]', 'null', 'Place in base to improve medicine manufacturing speed. Placing more than one has no additional effect.', '/public/images/build/T_icon_buildObject_Cauldron.png', NULL, 0, 32, 2),
