(216, 'Summoning Altar', '[\"Summoning Altar\"]', 'null', 'Offer a Slab depicting a Pal to summon a powerful Pal to your base. Adequate caution and battle readiness is paramount.', '/public/images/build/T_icon_buildObject_Altar.png', NULL, 1, 32, 3),
(217, 'Old Revolver', 'null', '[\"Old Revolver\"]', 'A slightly outdated revolving handgun.  Compared to <itemName id=|Handgun_default|/>, it excels in single-shot power.', '/public/images/weapon/T_itemicon_Weapon_OldRevolver.png', NULL, 0, 33, 3),
